    "content": "Mine sisu juurde Vikipedii-späi Tulgat tervhin! Tulgat tervhin Vepsän Vikipedijaha, joudjaha enciklopedijaha, kudambad sab redaktiruida kaikuččele ristitule! Vepsänkel\u0027žes Vikipedijas om 7078 kirjutust. Kaik kirjutused • Uded lehtpoled Sur\u0027oigenduzkund / Embassy / Посольство Help for non-Veps speakers / Помощь участникам, не владеющим вепсским Biografii Čomamahtod Geografii Istorii Matematik Kund Tedo Tehnologii Kaik kategorijad Säkat uz\u0027 lehtpol\u0027: Hüvä kirjutuz Karjal (ven.: Карелия, Карьяла) vai Venäman Karjal, täuz\u0027 oficialine nimituz — Karjalan Tazovaldkund (venäkelel: Республика Карелия, ičenaižkarjalan kelel: Karjalan tašavalta, livvinkarjalan kelel: Karjalan tazavaldu, suomen kelel: Karjalan tasavalta), om Venälaižen Federacijan subjekt, Venäman üks\u0027 tazovaldkundoišpäi. Se mülüb Lodehližhe federaližhe ümbrikho. Karjalan Tazovaldkundal om röunoid Arhangel\u0027skan agjanke päivnouzmal, Vologdan i Leningradan agjoidenke suvel, Suomenmanke päivlaskmal (798 km), Murmanskan agjanke pohjoižel. Karjalan pohjoižpäivnouzmaižed randad lainištab Jävaldmeren Vauged meri. Tazovaldkundan pälidn da kaikiš suremb lidn om Petroskoi. Eläjiden lugu om 622 484 ristitud (2018. vodel). Pind om 180 520 nellikkilometrad. Toižed hüväd kirjutused | lugeda enamba… Päivän foto Levitadud Xylaria hypoxylon-pusenüt Xylariaceae-sugukundaspäi mahusen erozijan sijas. Om heittud kartaižele matkan aigan Val Sinestra-mägialangištospäi («hura alangišt» romanšan kelespäi, 1474 m ü.m.t.) Alembaine Engadin-alangištho, Graubünden-kanton, Šveicarii, 14. reduku 2024. Kacuhtada Tedad-ik sinä, miše... Ngerulmud om kaikiš penemb pälidn mail\u0027mas 391 eläjanke? Istorižiš aigoiš händikahan areal oli kahtenz\u0027 pindan mödhe jäl\u0027ges ristitun arealad imetaiživatoiden keskes Mal? Änine om kahtenz\u0027 järv pindan mödhe Evropas rindataden Ladogjärvhe? Nevondkundaližen Ühtištusen vägiak (uroh), vepsläine Anna Lisicina upsi ehtatades Süväres poikpoli? Päiväižen veduz om 99,866 % Päiväižen sisteman vedust? Karjalan Tazovaldkundan Rahvahaline teatr Petroskoiš om üks\u0027jäine suomenkeline teatr Venämas? Pifagoran teoremal om 367 erazvuittušt todestamišt? Zubr om kaikiš järedamb da jügedamb imetaiživat Evropan kontinental da jäl\u0027gmäine evropalaine mechärgan ezitai? Elias Lönnrot oli lekar\u0027? Ezmäine fil\u0027m kinematografan istorijas om ozutadud vl 1885? Necen Vikipedijan polhe Nece om Vikipedii vepsän kelel Vepsän kelel pagištas Venämas — Karjalan Tazovaldkundas, Piteriš, Leningradan da Vologdan agjoiš. Vepsän kel\u0027 mülüb Baltijan meren suomalaižiden keliden gruppha. Sil ühthine literaturform da ičeze literatur oma olmas. Opetas vepsän kel\u0027t Piteriš — Venäman valdkundaližel pedagogižel universitetal (Pohjoižen rahvahiden institut) — da Petroskoiš — Petroskoin valdkundaližel universitetal. Opetas kel\u0027t mugažo Karjalan, Leningradan i Vologdan agjoiden školoiš. Informacii toižil kelil... / In other languages... Kalendar\u0027: tal’vku Sündnuded 5. tal\u0027vku (1901) — Uolt Disnei, AÜV:oiden mul\u0027tiplikacijan prodüser da režissör, «Walt Disney Productions»-kompanijan alusenpanii. 11. tal\u0027vku (1911) — Nagib Mahfuz, egiptalaine kirjutai-romanist da dramaturg romantizm- i realizm-žanroiš, vn 1988 literaturižen Nobelän premijan laureat. 16. tal\u0027vku (1770) — Lüdvig van Bethoven, saksalaine muzikankirjutai, dirižor da pianist, üks\u0027 «venalaižiš klassikoišpäi». 26. tal\u0027vku (1893) — Mao Czedun, kitajižen valdkundan šingotai, tedoti Kitain Rahvahaližen Tazovaldkundan sündundas vl 1949, radoi Kitain kompartijan Keskuzkomitetan ezimehen vspäi 1943 surmhasai. Völ: Kategorii:Sündnuded tal\u0027vkus Kolnuded 5. tal\u0027vku (1927) — Födor Sologub, venämalaine runokirjutai, kirjutai, dramaturg da publicist. 14. tal\u0027vku (1799) — Džordž Vašington, AÜV:oiden Tat-augonpanii, amerikaižen prezidentišton institutan sädai da Ühtenzoittud Štatoiden ezmäine prezident. 30. tal\u0027vku (1989) — Grigorii Vehin, nevondkundaline sodapämez\u0027, majorjenaral; Nevondkundaližen Ühtištusen vägimez\u0027 (1945). Völ: Kategorii:Kolnuded tal\u0027vkus Kacuhtada Kategorijad Matematižed, fizižed da naturaližed tedod Astronomii • Biologii • Ekologii • Fizik • Geologii • Himii • Kibernetik • Logik • Matematik • Meteorologii • Statistik • Naturaližed tedod Socialižed tedod, istorii da geografii Antropologii • Arheologii • Ekonomik • Etnografii • Filosofii • Finansad • Fol\u0027kloristik • Geografii • Istorii • Pedagogik • Politik • Psihologii • Sociologii Tehnologii da ekonomik Maižanduz • Arhitektur • Elektronik • Elektrotehnik • Energetik • Informatik • Inženerii • Internet • Kartografii • Kirjištod • Kommunikacijad • Medicin • Ohjanduz • Sauvond • Sodatö • Tegimišt • Tehnologii • Torguind • Transport • Veterinarii Čomamahtod Arhitektur • Čomamahtontedo • Fotografii • Karg • Kino • Literatur • Muzik • Pirdand • Skul\u0027ptur • Teatr • TV Kund Demografii • Emänduz da kodiižanduz • Hobbid • Jurisprudencii • Keled • Londusenkaičend • Mifologii • Ogerantegend • Openduz • Politik • Rahvahankul\u0027tur • Religii • Socialine abu • Sociologii • Sport • Tervhuz • Turizm • TV Vepsänm",
