    "title": "Wikipedia",
    "content": "Naar inhoud springen Van Wikipedia Welkom bie Wikipedia Vandaag is \u0027t zaoterdig 13 december 2025 Is d\u0027n datum neet richtig? Laeg de cache. Wikipedia is \u0027n gratis vriejen inhoud-encyclopedie in väöl tale die in samewirkingsverbandj weurt gesjreve. Edereine, dus ouch doe, kan hie artikele toevoge en bewirke, mit en ouch zónger aanmelding. Wils doe e nuuj en/of eige artikel sjrieve en toevoge, klik dan op: nuuj artikel make. As te iers wils experimentere mit de wiki-syntax, kan dat in de zandjbak. Gein idee wie me Limburgs sjrief? Dan laes Wikipedia:Wie sjrief ich Limburgs ins. Bezeuk ós gebroekersportaol óm oet te vènje wie das doe jeder artikel kans bewirke. In de kaffee kans te vraoge sjtèlle euver \u0027t projek en kalle mit anger Wikipediane. Dees Limburgse Wikipedia is begós in 2004 en op \u0027t moment zin d\u0027r 15.146 artikele. Oetgeleech artikel: Vakwerkhoes De name van de belk in e vakwerkhoes, in Limbörgs boewjargon. E vakwerkhoes is e geboew dat gemaak is van eikehoute of anger soort helhoute belk, tek en leim. De constructie, \u0027t gerièmsj of raomwerk, besjteit oet vakke. In die vakke zeen ouch de vinstere en deure verwirk. Boewe mit hout en leim gebäörde al in d\u0027n tied van de Bandkeramiekers (5000 v.Chr.). De geraemsele van houte belk kaome pas later. Vakwerkhoezer zeen tot in de neugeteenden iew geboewd, mae waorte lank gezeen es teike van ermooj. In d\u0027n twintigsten iew is me vakwerk zjus gaon waardere en zeen väöl auw hoezer gerestaureerd. Laes mie... Ieder artikele op \u0027t Veurblaad Limburg (portaole Nederlands- en Belsj Limburg) Nederlands Limburg - Belsj Limburg - Limburgs - Maas - Mestreech - Hasselt - Hertogdom Limburg - Limburg (stad) Exacte weitesjappe Aerdweitesjappe - Biologie - Informatica - Wiskónde - Natuurkónde - Chemie - Sjterrekónde Minsjweitesjappe Antropologie - Archeologie - Cognitieweitesjap - Filosofie - Geografie - Historie - Pedagogie - Psychologie - Sociologie - Tale en Taalweitesjap Politiek, rech en maatsjappie Economie - Familie - Handel - Kreegsveuring - Milieu - Óngerwies - Politiek - Rech - Lies van beroepe Kuns en cultuur Architectuur - Beeldhouwkuns - Film - Literatuur - Muziek - Religie - Sjilderkuns - Volkscultuur Toegepasde weitesjappe Computer - Genaeskónde - Landboew - Meteorologie - Ruumdevaert - Sjtatistiek - Techniek Dageliks laeve en vrieën tied Gezóndheid - Hovenere - Kaokkuns - Seksualiteit - Sjpel - Sjport - Toerisme - Vastelaovend - Voeding Algemein dinger Nuuj artikele - Biografieë - In \u0027t nuujs - Wikipedia op categorieë Alle informatie veur gebroekers en mitwèrkers van de Limburgse Wikipedia Actueel artikele Crisis en krieg in de Oekraïne: \u0027ne krieg dae oet versjillende fases besjteit: de inname van de Krim door Róslandj in 2014, \u0027t conflik tösje \u0027t Oekraïense laeger en pro-Róssische separatiste in d\u0027n Donbass (2014-2022) en de Róssische invasie van 2022. De krieg haet groete humanitair probleme veroerzaak. COVID-19: \u0027n besmettelike gekrenkdje veroearzaak door \u0027t coronavirus SARS-CoV-2. In de volksmóndj is coronavirus ouch de naam veur de ganse gekrenkdje. De gekrenkdje kwaam veuren ieëste veur in Wuhan, wodoor \u0027t ouch waalens \u0027t Wuhanvirus woort geneump. Doordet miense gein immuniteit veur \u0027t virus hajen, \u0027t ouch gei vaccin goof en \u0027t virus zier sjnel kint mutere is saer 11 mieërt 2020 officieel spraok van \u0027n pandemie. Europese migrantecrisis: de groete toenaam van asielzeukers die Europa binnekómme saer 2014. Islamitische Staot: \u0027n bewaopende organisatie die \u0027n islamitisch kalifaat wilt oprichte in \u0027t Midde-Oeste en good vertaegeweurdig waor in Syrië en Irak. Huuj is de terreurbeweging nog ömmer aktief inne regio, mer door \u0027n internasjonaal coalisie ónger leijing vanne VS en zjwaor Róssische bombardemente woort ze militair en territoriaal versjlage. Arabisch Veurjaor: \u0027n rits aan demonstraties, opstenj en gewaopende kónflikte taege zittende regeringe in \u0027t Midde-Oeste tösje inj 2010 en 2012. Kórte nuujsbesjeie euver actueel gebäörtenisse bewirk Wikipedia op anger tale Wikipedia\u0027s mit mier as ein miljoen artikele: Deutsch (Duutsj) – English (Èngels) – Français (Frans) – Italiano (Italiaans) – Nederlands – Polski (Pools) – Русский (Róssisch) – Sinugboanong Binisaya (Cebuano) – Svenska (Zjwaeds) – Tiếng Việt (Vietnamees) – Winaray (Waray-Waray) Wikipedia\u0027s mit mier as 100.000 artikele: العربية (Arabisch) – Azərbaycanca (Azerbeidzjaans) – Български (Bulgaars) – Català (Catalaans) – Čeština (Tsjechisch) – Dansk (Daens) – Eesti (Estisch) – Ελληνικά (Grieks) – Español (Sjpaans) – Esperanto – Euskara (Baskisch) – فارسی (Perzisch) – Galego (Galicisch) – Հայերեն (Armeens) – हिन्दी (Hindi) – Hrvatska (Kroatisch) – עברית (Hebreeuws) – Bahasa Indonesia (Indonesisch) – 日本語 (Japans) – Қазақша (Kazachs) – 한국어 (Koreaans) – Latina (Latien) – Lietuvių (Litouws) – Magyar (Hongaars) Bahasa Melayu (Maleisisch) – Minangkabau – Norsk - Bokmål (Naors - \u0027Boketaal\u0027) – Norsk - Nynorsk (Naors - \u0027Nuujnaors\u0027) – O\u0027zbek (Oezbeeks) – Português (Portugees) – Română (Roemeens) – Simple English (Sum",
