    "url": "https://en.wikipedia.org/wiki/United_States_Secretary_of_State",
    "title": "United States Secretary of State - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Head of the US Department of State Not to be confused with Secretary of state (U.S. state government). United States Secretary of State Seal of the secretary of state Flag of the secretary of state Incumbent Marco Rubio since January 21, 2025 United States Department of State Style Mr. Secretary (informal) The Honorable[1] (formal) His Excellency[2] (diplomatic) Abbreviation SecState Member of Cabinet of the United States United States National Security Council Reports to President of the United States Seat Harry S Truman Building Washington, D.C. Appointer The president with Senate advice and consent Term length No fixed term Constituting instrument 22 U.S.C. § 2651 Precursor Secretary of Foreign Affairs Formation July 27, 1789; 236 years ago (1789-07-27) First holder Thomas Jefferson Succession Fourth[3] Deputy United States Deputy Secretary of State Salary Executive Schedule, Level I[4] Website state.gov/secretary The United States secretary of state (SecState)[5] is a member of the executive branch of the federal government of the United States and the head of the U.S. Department of State, equivalent to a minister of foreign affairs. The secretary of state serves as the principal advisor to the president of the United States on all foreign affairs matters. The secretary carries out the president\u0027s foreign policies through the U.S Department of State, which includes the Foreign Service, Civil Service, and U.S. Agency for International Development. The office holder is the second-highest-ranking member of the president\u0027s cabinet, after the vice president, and ranks fourth in the presidential line of succession; and is first amongst cabinet secretaries. Created in 1789 with Thomas Jefferson as its first office holder, the secretary of state represents the United States to foreign countries, and is therefore considered analogous to a secretary or minister of foreign affairs in other countries.[6][7] The secretary of state is nominated by the president of the United States and, following a confirmation hearing before the Senate Committee on Foreign Relations, is confirmed by the Senate. The secretary of state, along with the secretary of the treasury, secretary of defense, and attorney general, are generally regarded as the four most crucial Cabinet members because of the importance of their respective departments.[8] The secretary of state is a Level I position in the Executive Schedule and thus earns the salary prescribed for that level, $250,600 as of January 2025[update].[4][9] History [edit] The secretary of state originates from the government under the Articles of Confederation. The Congress of the Confederation established the Department of Foreign Affairs in 1781 and created the office of secretary of foreign affairs.[10] After the Constitution of the United States was ratified, the 1st United States Congress reestablished the department, renaming it the Department of State, and created the office of secretary of state to lead the department.[11][12] Duties and responsibilities [edit] The stated duties of the secretary of state are to supervise the United States foreign service and immigration policy and administer the Department of State. The secretary must also advise the president on U.S. foreign matters such as the appointment of diplomats and ambassadors, advising the president of the dismissal and recall of these people. The secretary of state can conduct negotiations, interpret, and terminate treaties relating to foreign policy. The secretary also can participate in international conferences, organizations, and agencies as a representative of the United States. The secretary communicates issues relating to the U.S. foreign policy to Congress and citizens. The secretary also provides services to U.S. citizens living or traveling abroad such as providing credentials in the form of passports. Doing this, the secretary also ensures the protection of citizens, their property, and interests in foreign countries.[13] What are the Qualifications of a Secretary of State? He ought to be a Man of universal Reading in Laws, Governments, History. Our whole terrestrial Universe ought to be summarily comprehended in his Mind. —John Adams[14] Secretaries of state also have domestic responsibilities. Most of the historical domestic functions of the Department of State were gradually transferred to other agencies by the late 19th century as part of various administrative reforms and restructurings.[15] Those that remain include storage and use of the Great Seal, performance of protocol functions for the White House, and the drafting of certain proclamations. The secretary also negotiates with the individual states over the extradition of fugitives to foreign countries.[13] Under federal law, the resignation of a president or of a vice president is valid only if declared in writing, in an instrument delivered to the office of the secretary of state.[16] Acco",
