    "content": "Kontentke ótiw Wikipedia — erkin enciklopediya Qaraqalpaqsha Wikipedia joybarına xosh keldińiz! Házirgi waqıtta qaraqalpaq tilinde 10 920 maqala bar. 2025-jıl 15-dekabr (dúyshembi) – 15:08 UTC (tazalaw) Mobil / Desktop kórinis Wikipedia maqalaları, tiykarınan, volontyorlar tárepinen jaratıladı. Siz de Wikipedia betlerin redaktorlawıńız múmkin! Biologiya Fizika Muzıka Qaraqalpaqstan Ximiya Kórkem óner Tariyx Sport Geografiya Feminizm Kúnniń saylandı súwreti Úlgi:Potd/2025-12-15 (kaa) original inglisshe sıpatlaması Wiki-kalendar: 15-dekabr Bayramlar Waqıyalar Tuwılǵanlar (hámmesi) Qaytıs bolǵanlar (hámmesi) Ózgertiw Kúnniń saylandı multimediası Úlgi:Motd/2025-12-15 (kaa) original inglisshe sıpatlaması Saylandı maqala Ibrayım Yusupov Ibrayım Yusupov (tolıq atı Ibrayım Yusupovich Yusupov, russha Ибрагим Юсупов, inglisshe Ibrahim Yusupov; 1929-jıl 5-may, Shımbay — 2008-jıl 24-iyul, Nókis) — qaraqalpaq shayırı, XX ásir qaraqalpaq ádebiyatınıń iri wákili, awdarmashı hám dramaturg, pedagog. Ózbekstan hám Qaraqalpaqstan xalıq shayırı. Ózbekstan Qaharmanı (2004-jılı). Qaraqalpaqstan Respublikası mámleketlik gimni sózi avtorı. Ádebiy laqabı — Ayaziy. Ibrayım Yusupovich Yusupov 1929-jıl 5-mayda Qaraqalpaqstan Respublikası, Shımbay rayonı, Azat awılında tuwılǵan. Bolajaq shayırdıń ákesi Yusup (axun) Sayekeev (1875-1931-jıllar) óz dáwiriniń diniy ǵayratkeri hámde iri jer iyesi bolıp, Sovet húkimeti tárepinen quwdalawǵa ushırap, 1931-jılı Túrkmenstanǵa súrgin etilgen hám onnan qaytpaǵan. Anası Xanbiybi eki ul hám tórt qızdı tárbiyalaǵan. Shańaraqtı baǵıwda anasına járdem beriw ushın jas Ibrayım 13 jasınan baslap jumıs islewdi basladı. Qaraqalpaq mámleketlik pedagogika institutında oqıǵan. Instituttı 1949-jılda tamamlaǵan Ibrayım ózi oqıǵan bilim dárgayında ádebiyat páninen sabaq bere basladı. 1961-1962-jıllarda «Ámiwdárya» jurnalı redaktorı, keyingi 3 jıl SSSR Pánler Akademiyası Qaraqalpaq filialınıń N. Dáwqaraev atındaǵı til, ádebiyat hám tariyx institutında ilimiy jumıs alıp bardı. 1965-1980-jıllarda Qaraqalpaq ASSR jazıwshılar awqamına basshılıq etken. Onıń baslaması menen SSSRdıń kóplegen qalalarında, atap aytqanda, Moskva, Kiev, Alma-Ata, Vilnyus hám basqa qalalarda birinshe márte Qaraqalpaq mádeniyatı kúnleri ótkerildi. 1980-1988-jıllarda «Sovet Qaraqalpaqstanı» (házirgi atı «Erkin Qaraqalpaqstan») gazetasında bas redaktor boldı. Dawamı... Bilesiz be? Eyjafjallajökull muzlıǵı Jer silkiniwlerdi boljaw metodı elege shekem joq. Alfred Nobel teoriyalıq pánlerge qızıqpaǵanı ushın matematiklerge Nobel sıylıǵın beriwdi shólkemlestirmegen («muxabbatı matematik penen qashıp ketkeni ushın» degen gáp bolsa ańız). Islandiyadaǵı Eyjafjallajökull muzlıǵı (súwrette) atın dúnya xalqınıń 0.005 procenti tuwrı ayta aladı. Xanzada Viktoriya ómirlik joldası shahzada Albert óliminen keyin 40 jıldan artıq qara kiyim kiyip júrdi hám ómiriniń aqırına shekem matam tuttı. Avtomobil áyneklerin qaraytıw — qılmıs emes. Kompyuter tıshqanshasın isletiw múmkin bolǵan dáslepki kompyuter Xerox Alto bolǵan. Ózgertiw Wikipedia haqqında Wikipedia logotipi Wikipedia — bul ashıq enciklopediya bolıp, hárbir qálewshi bul enciklopediyada qatnasıp, óz úlesin qosıwı múmkin. Joybar globallıq, kóp tilli joybar bolıp, onıń maqseti — hámme ushın ashıq bolǵan biypul onlayn enciklopediya jaratıwdan ibarat. Wikipedia búgingi kúnde Wikimedia Fondı shólkemi tárepinen basqarıladı. Maqalalar, tiykarınan, volontyorlar tárepinen jaratıladı. Eger siz Wikipedia joybarına birinshi márte kelip turǵan bolsańız, maqala jazıwshılar ushın qısqa qollanba menen tanısıp shıǵıwıńızdı másláhát beremiz. Demek, siz Wikipediada maqala jaratıw qaǵıydaların álleqashan ózlestirgensiz, biraq qanday maqala jazıwdı bilmey turıpsız. Onda hámme Wikipedialarda bolıwı tiyis maqalalar dizimi menen tanısıp shıǵıń, bálkim, sol jerde ózińizge qızıqlı bolǵan maqala atamaların tabarsız. Qaraqalpaqsha Wikipediada maqalanı qaraqalpaq tili imla qaǵıydalarına tolıq boysınǵan halda, qátesiz jazıwǵa háreket etiń. Bul jerde basqa tillerde jazıw qadaǵan etiledi hám olar administrator(lar) tárepinen talqılawsız óshiriledi. Wikipediaǵa úles qosıwdı baslawdan aldın ózińizge akkaunt jaratıwdı másláhát etemiz. Maqala jaratıwdan aldın sol atamadaǵı maqala álleqashan jaratılǵan yamasa jaratılmaǵanlıǵın tekserip kóriń. Onıń ushın usı bettiń joqarǵı oń jaǵında jaylasqan «Wikipediadan izlew» tekst maydanına maqala atamasın jazıp, «Izlew»di basıń. Eger siz saylaǵan atamadaǵı maqala ele jazılmaǵan bolsa, onı jaratıw ushın tómendegi tekst maydanına maqalańızdıń atamasın jazıp, «Maqala jaratıw»dı basıń. Kategoriyalar Mádeniyat Ádebiyat · Din · Filosofiya · Kino · Oyınlar · Saz · Sport · Bilimlendiriw · Teatr · Tiller · Turizm · Úrp-ádet Bilim, Matematika hám Tábiyat Biologiya · Ekonomika · Fizika · Geologiya · Informatika · Medicina · Psixologiya · Jámiyet Adamlar · Bilim · Densawlıq · Ekonomika · Filosofiya · Finans · Húkimet · Huqıq · Shańaraq · Siyasat Texnologiya Elektronika · Injenerlik isi · Internet · Kompyuter · Medic",
