    "title": "Wikipedia",
    "content": "Hankany amin\u0027ny vontoatiny Avy amin\u0027i Wikipedia Tonga soa eto amin’i Wikipedia ny raki-pahalalana malalaka azon’ny tsirairay ovaina Lahatsoratra 101 544 amin’ny teny malagasy Pejy rehetra · Sokajy · Fikambanana · Fanoroana Lahatsoratra notsongaina ho an’ity volana ity I Iràna na Repoblika Islamikan\u0027 i Iràna dia firenena ao Azia Andrefana. Ny renivohiny dia i Teheran. Atao hoe ایران‎ [ʔiˈɾɒn] na جمهوری اسلامی ایران‎ / Jomhuri-ye Eslāmi-ye Irān izy amin\u0027 ny fiteny persana. Ny anarana nohagasina hoe Iràna dia avy amin\u0027 ny fiteny persana izay midika hoe \"Tanin\u0027 ny Arianina\", ary efa nampiasain\u0027 ny Persiana hatry ny Andro Taloha, tamin\u0027 ny andron\u0027 ny Sasanida. Persia no fiantsoan\u0027 ny Tandrefana an\u0027 i Iràna nanomboka tamin\u0027 ny Andro Taloha hatramin\u0027 ny taona 1935. I Reza Shah no nanova izany ho Irān tamin\u0027 io taona io tamin\u0027 ny alalan\u0027 ny fangatahana amin\u0027 ny firenena rehetra izay mifandray aminy hiantso an\u0027 ilay firenena hoe \"Irān\". Sarin-tanin\u0027 i Iràna Firenena faha-18 be velarana indrindra (1 648 000 km2) i Iràna; 78 tapitrisa ny isan\u0027 ny mponina ao aminy. I Armenia sy i Azerbaijàna ary i Torkmenistàna no firenena manodidina azy ao avaratra; ny Hoala Persika no ao atsimo; i Iràka sy i Torkia no firenena manodidina azy ao andrefana; i Pakistàna sy i Afganistàna no ao atsinanany. Ny vola ampiasaina ao Iràna dia ny Rial. Ny kalandrie persana no kalandrie ôfisialy ary ny fiteny persana no fiteny ôfisialy. Ahitana lembalemba avo, izay manana salan-kaambo 1 300 m, ny ampahany be amin\u0027 ny tanin\u0027 i Iràna. Ahitana tany efitra roa lehibe ny any, dia i Dasht-e Kavir ao avaratra sy i Dasht-e Lut ao atsimo-atsinanana. Hodidinin’ ny tangoron-tendrombohitra maro koa i Iràna: ao avaratra manamorona ny Ranomasina Kaspiana no misy an\u0027 ny tangoron-tendrombohitra Alborz; ao atsimo-andrefana i Zagros. Ny toerana iva indrindra any Iràna dia ny Ranomasina Kaspiana izay 28 m ambanin\u0027 ny haambon\u0027 ny ranomasina. Toetanin-tanibe maina ny toetanin\u0027 i Iràna, izay ahitana fiovaovana lehibe eo amin\u0027 ny mari-pana. Haingam-pitombo sady betsaka tanora (ny 44 % dia latsaky ny 15 taona) ary monina an-tanan-dehibe (ny 65 %, na mihoatra, dia monina an-tanàn-dehibe) ankamaroan\u0027 ny mponina ao Iràna. Ny Persiana sy vahoaka vitsy anisa maro (anisan\u0027 izany ny Azery, ny Balotsy, ny Torkmena, ny Kiorda ary ny Arabo) no madrafitra ny mponina any Iràna. Ny fivavahana silamo no fivavahan\u0027 ny 99 % amin\u0027 ny mponina any Iràna. I Iràna no mpanondrana solitany fahefatra maneran-tany. Na dia ny 10 % amin\u0027 ny tany ihany aza no voavoly dia manan-danja eo amin\u0027 ny toekaren\u0027 i Iràna ny fambolena. I Iràna, ohatra, no mpamokatra antrendry voalohany indrindra maneran-tany. Izy koa no miantoka ny 20 %n\u0027 ny famokarana kaviara maneran-tany. (tohiny...) Lahatsoratra tsara vakiana Ankizy mahafaly Ny Mahafaly dia vondrom-poko ao amin\u0027 ny faritra atsimo-andrefana amin\u0027 i Madagasikara, eo anelanelan\u0027 ny ony Menarandra ao atsimo sy Onilahy ao avaratra no fonenany nentim-paharazana, eo amin\u0027 ny lembalemba be sokay sy fasika izay mitondra io anarana Mahafaly io ihany. Malaza amin\u0027 ny fahaizana manao sary sokitra ny Mahafaly ka isan\u0027 izany ny fanamboarana aloalo izay entiny manaingo ny fasana sy manaja ny razana sy ny mpanjaka maty. I Betioky sy i Ejeda ary i Ampanihy no tanàna ngezangeza ao aminy. Anisan\u0027 ny fady amin\u0027 ny Mahafaly, toy ny Antandroy koa, ny mihinana sokatra (mahafaly: sokake). Tamin\u0027 ny taona 2013 dia tombanana ho 150 000 ny isan\u0027 ny Mahafaly[1]. Mpiompy omby sy osy sy ondry ary akoho amam-borona (anisan\u0027 izany ny vorontsiloza) ny Mahafaly. Mamboly mangahazo sy voamaina koa ny mponina amin\u0027 ny faritra mahafaly. Heverina ho avy ao amin\u0027 ny faritra atsimo-atsinanan\u0027 i Afrika ny sasany amin\u0027 ny razamben\u0027 ny Mahafaly voalohany izay tonga teto amin \u0027 ny Nosy tamin\u0027 ny taonjato faha-12. Nanjary malaza izy ireo noho ny fasana lehibe aoriny ho fanomezam-boninahitra ny lehibe sy ny mpanjaka maty. Miteny mahafaly, izay fitenim-paritra mifanakaiky amin\u0027 ny fiteny antandroy, izay fiteny malagasy, sampan\u0027 ny vondrom-piteny malaiô-pôlineziana ny Mahafaly. Ny anarana hoe Mahafaly dia nampiasain\u0027 ny Malagasy hafa sy ny vahiny hilazana ireo olona nipetraka amin\u0027 ny morontsiraka atsimo-andrefan\u0027 i Madagasikara, voafaritry ny ony Menarandra sy Onilahy[2]. Ny Mahafaly tenany anefa tsy mampiasa an\u0027 io teny io ary tsy milaza azy ireo ho foko tokana, fa aleony manonona ny tenany araka ny firazanana hafa na ara-jeôpôlitika; ny anarana hoe Mahafaly dia tsy misy heviny ho an\u0027 ny olona avy amin\u0027 io faritra io fa mari-pamantarana napetraky ny avy any ivelany[3]. Ny ankamaroan\u0027 ny Mahafaly dia monina amin\u0027 ny moron\u0027 ny renirano sy ony mamakivaky faritra tena maina[4]. (tohiny...) Sarin’ny anio ◄ ► Ny vaovao Mitranga amin\u0027izao fotoana izao : Hetsi-panoheran\u0027ny 2025 eto Madagasikara[ovaina] Fangatahan\u0027ny fifaranan\u0027ny fitapahana matetiky ny rano sy herinaratra Efemerida Talata, 9 Desambra 2025 Mbola tsy misy ankehitriny ny pejy mikasika ny Talata 9 Desambra ao amin\u0027ny efemerida. Ka raha tianao di",
