    "content": "Jump to content \"Wikiibíídiiya\" bitsʼą́ą́dę́ę́ʼ Níłchʼitsoh 9, 2025go yoołkááł Wikiibíídiiya yee Hadítʼéhígíí Ni Hodisxǫs Naaldlooshii Naʼashǫ́ʼii/Chʼał/Tłʼiish Tsídii Chʼosh dóó Łóóʼ Naniseʼ Wikiibíídiiya baa haneʼ What language is this? Díí Wikiibíídiiya éí Noto Sans dóó Noto Serif wolyéego saad bee álʼíinii choyoołʼįįh \"Wikiibíídiiyahísh\" éí haʼátʼíí lá átʼé? · Wikiibíídiiya yee hadítʼéhígíí Daʼ Nił Bééhózin...? Naatsédlózii éí yótʼáahdi tsídii dah yikahjí atah yisdzoh, áádóó éí Náhookǫsjí kéyah dah siʼánígíí bikááʼgóó tʼéiyá hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \"Geococcyx californianus\" deiłníigo dayózhí. Díí tsídii éí 22di asdzoh áníłnééz, 12 oz áníłdáás. Díí tsídii éí dinilzhin dóó bitseeʼ ałdóʼ dinilzhin. Biteeldę́ę́ʼ éí łigai. Naatsédlózii éí hosh biyaagóó éí doodaiiʼ éí chʼiltsoh naazkaadgóó bitʼoh ánáyiilʼįįh. Akǫ́ʼ tááʼ–hastą́ągoda ayęęzhii ninéíniiłgo nináhah. Áádóó biyázhí ayęęzhii yiihajáá dóó éí tseebíítsʼáadah nidiʼdzíʼjíʼ nitsá dáalééh, áádóó... (nááná...) Diné Bikéyah Diné Bizaad yee Nidaazbaaʼígíí Diné Bikéyah beʼelyaaígíí Dinétah Béésh bąąh dah siʼání Kin Dah Naazhjaaʼ dóó Kin Hadaasʼá Kin Yótʼááh Deezʼá éí Shádiʼááhjí Kin Yótʼááh Deezʼá Hahoodzodi áhootʼéego bił hazʼą́. Haʼaʼaahjí Tónteel bibąąhgi éí kin haalʼá, áádóó éí 468.4 tsinsitą́ dikʼą́ągo... (nááná...) Yágháhonikáánjí Bił Naaztʼiʼígíí Jóhonaaʼéí éí sǫʼ átʼé áádóó díí yágháhookáán ałníiʼdi siʼą́. Jóhonaaʼéí éí 865,000 tsinsitą́ áníłtso; éí doodaiiʼ éí, nahasdzáán 109di kʼinaʼniildéélgo áníłtso... (nááná...) Ádahooníłígíí Eʼeʼaahjí Ghą́ą́ʼaskʼidii Biłikahii Bikéyahdi kéyah haʼdiná Tónteel Łichííʼídi tsiikʼi déíbaalí łaʼ tsin naaʼeeł hééł bee naagéhé yitaadaʼałdon Biʼééʼ Łichííʼí Bikéyah bisiláołtsooí Dzítso Hatsohnii Bikéyah yiih yízééh Biʼééʼ Łitsxooí Bikéyahdi yéigo daʼahijoogą́ą́ʼ Bidił Daazdoígíí dóó Daʼałtʼoʼígíí Ayání Bįįh Chaaʼ Dahsání Gólízhii Mąʼii dootłʼizhí Naʼastsʼǫǫsí Shash Tsétah tłʼízí Tsinlátah ayáanii Naʼashǫ́ʼii dóó Táyiʼ dóó Niʼkáágóó Ndaakaaígíí Chʼał Chʼééh digháhii Diyóósh Naʼashǫ́ʼii Naalnoodí Táłkááʼtsʼin Tiníléí Tsékʼi naʼazólii Tsxilghááh Tłʼiish Tsídii (Ndaatʼaʼígíí) Atsá Dahiitį́hii Gáagii Giní Hasbídí Jeeshóóʼ Chʼiyíítʼogii Tsídiitsoh Chʼosh dóó Łóóʼ Iichʼąhii Kʼíneedlíshii Naakaii náásééł Wónikǫsí Zahalchíʼii Séigoʼ Łóóʼ adishishí Łóóʼ hashkéhé Naniseʼ (Chʼil dóó Tsin) Atsá chʼil Bįįh yiljaaʼí Chʼóshgai Diniʼeechʼil áłtsʼóózígíí Hosh aditsahiitsoh Kʼaiʼ Kʼįįʼ Ndikʼąʼ Ndoochííʼ Tłʼoh azihii Waaʼ Zééʼiilwoʼii Wikimedia Commons Ééʼdaalyaaígíí (\"Creative Commons\" beehazʼą́ąnii bikʼehgo) Wikispecies Naaldlooshii dóó chʼil dabízhiʼ ałkééʼ daasdzoh (Ndaʼałkaahí bikʼehgo) 2 ałʼąą dineʼé bizaad English Español Wikiibíídiiyagi bíkanítá tʼáá yíní átʼéegi Íiyisíí Naaltsoos 2 ałʼąą dineʼé bizaad haneʼ / łahjįʼ ániidí",
