    "title": "Supreme Commander for the Allied Powers - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia This article has multiple issues. Please help improve it or discuss these issues on the talk page. (Learn how and when to remove these messages) This article is written like a personal reflection, personal essay, or argumentative essay that states a Wikipedia editor\u0027s personal feelings or presents an original argument about a topic. Please help improve it by rewriting it in an encyclopedic style. (July 2023) (Learn how and when to remove this message) This article may be confusing or unclear to readers. In particular, the article is a disorganized jumble of passages about MacArthur. Please help clarify the article. There might be a discussion about this on the talk page. (July 2023) (Learn how and when to remove this message) (Learn how and when to remove this message) Head of the Allied occupation of Japan The Dai-Ichi Seimei Building which served as SCAP headquarters, c. 1950 The Supreme Commander for the Allied Powers (Japanese: 連合国軍最高司令官, romanized: Rengōkokugun saikōshireikan), or SCAP, was the title held by General Douglas MacArthur during the United States–led Allied occupation of Japan following World War II. It issued SCAP Directives (alias SCAPIN, SCAP Index Number) to the Japanese government, aiming to suppress its \"militaristic nationalism\".[1] The position was created at the start of the occupation of Japan on August 14, 1945.[2] It was originally styled the Supreme Commander of the Allied Powers.[3] In Japan, the position was generally referred to as GHQ (General Headquarters), as SCAP also referred to the offices of the occupation (which was officially referred by SCAP itself as General Headquarters, Supreme Commander for the Allied Powers (連合国軍最高司令官総司令部, Rengōkokugun saikōshireikan sōshireibu; abbreviated as GHQ–SCAP)), including a staff of several hundred US civil servants as well as military personnel. Some of these personnel effectively wrote a first draft of the Japanese Constitution, which the National Diet then ratified after a few amendments. Australian, British Empire, and New Zealand forces under SCAP were organized into a sub-command known as British Commonwealth Occupation Force. These actions led MacArthur to be viewed as the new Imperial force in Japan by many Japanese political and civilian figures, even being considered to be the rebirth of the shōgun-style government[4]: 341  which Japan was ruled under until the start of the Meiji Restoration. American biographer William Manchester argues that without MacArthur\u0027s leadership, Japan would not have been able to make the move from an imperial, totalitarian state to a democracy. At his appointment, MacArthur announced that he sought to \"restore security, dignity and self-respect\" to the Japanese people.[5] MacArthur was also in charge of southern Korea from 1945 to 1948 due to the lack of clear orders or initiative from Washington, D.C. There was no plan or guideline given to MacArthur from the Joint Chiefs of Staff or the State Department on how to rule Korea, resulting in a tumultuous 3 year military occupation that led to the creation of the U.S.-friendly Republic of Korea in 1948. He ordered Lieutenant General John R. Hodge, who accepted the surrender of Japanese forces in southern Korea in September 1945, to govern that area on SCAP\u0027s behalf and report to him in Tokyo.[6][7] General MacArthur [edit] Main article: Douglas MacArthur MacArthur arrives at Atsugi airfield in Kanagawa, August 30th, 1945 SCAP is oftentimes synonymous with its appointed post war leader, American General Douglas MacArthur. As Supreme Commander for the Allied Powers, MacArthur decided not to prosecute Shirō Ishii and all members of the bacteriological research units in exchange for germ warfare data based on human experimentation. On May 6, 1947, he wrote to Washington that \"additional data, possibly some statements from Ishii probably can be obtained by informing Japanese involved that information will be retained in intelligence channels and will not be employed as \u0027War Crimes\u0027 evidence.\"[8] The deal was concluded in 1948.[9] According to historian Herbert Bix in Hirohito and the Making of Modern Japan, \"MacArthur\u0027s truly extraordinary measures to save the Emperor from trial as a war criminal had a lasting and profoundly distorting impact on Japanese understanding of the lost war.\"[10] MacArthur\u0027s reasoning was that if the emperor were executed or sentenced to life imprisonment there would be a violent backlash and revolution from the Japanese of all social classes, and this would interfere with his primary goal of changing Japan from a militarist, feudal society to a pro-Western modern democracy. In a cable sent to General Dwight Eisenhower in February 1946, MacArthur stated that executing or imprisoning the emperor would require the use of one million occupation soldiers to keep the peace.[11] SCAP\u0027s relationship with Japanese leadership [edit] General MacArthur and Emperor Hirohito, 29th of Se",
