    "content": "跳至內容 文出維基大典 丙戌七夕，文言維基大典用世。共筆修典，以獻天下。至今得文一萬三千八百九十七。 夫維基者，知以公天下，以為天下利。 下筆之先，宜閱凡例、章法，以通文理，萬望矜察。 又，詳共平議，請至會館；欲覽新治，惠訪監修。 卓著 許浚朝服像 許浚，字淸源，號龜岩，朝鮮陽川人，中宗三十二年生，一說三十四年生。 宣祖二年，為柳希春所薦，入內醫院。四年，任從四品內醫院僉正。六年，任正三品內醫院正。八年，與安光翼入診上脈。十四年，受命監校《纂圖方論脈訣集成》，並題跋。二十年，上體平復，受賜鹿皮。二十三年，救療王子，受命加資，賜以爵秩，任正三品通政大夫，堂上官。兩司以王子有疾，用藥治療，醫官職分內事故，連啟罷改、還收，上不允。 二十五年，倭兵入寇，扈從宣祖，始終不離。二十八年，上御別殿便房，受針灸。二十九年，治東宮，加資，任正二品正憲大夫。司諫院復以東宮有疾，御醫議藥，屬職分內事故，啟請改正，上不從。 三十年，與都提調金應南等入侍。三十三年，任內醫院首醫。翌年，著成《諺解胎產集要》《諺解救急方》《諺解痘瘡集要》。三十七年六月，冊錄三等忠勤貞亮扈聖功臣。十月，上曰︰「浚博通諸書，老於用藥」。官至從一品崇祿大夫，封陽平君。 卓著一覽－評選卓著 正典 《水星領航士》，漫畫也，天野梢作。西元二千有二年始載，越三載冬製為動畫。合有漫畫十四冊，中有二為首部曲，所以述本事。動畫凡製三部。別有小說二冊，藤咲亞由菜等合著。 正典一覽－評選正典 新知 近衛公爵 英人嘗於南愛爾蘭立何等立法機關，而終歸於無用乎？ 近世埃及肇建，誰人首稱赫迪夫邪？ 及抗戰起，是時居日揆（圖）者何人？ 一九六三年，南越軍亂，誰人與總統同罹難？ 昔鄂圖曼帝國三帕夏，孰為最年少者？ 大典新知－評選新知 鑒賞 俠客行　李白 趙客縵胡纓，吳鉤霜雪明。 銀鞍照白馬，颯沓如流星。 十步殺一人，千里不留行。 事了拂衣去，深藏身與名。 閑過信陵飲，脫劍膝前橫。 將炙啖朱亥，持觴勸侯嬴。 三杯吐然諾，五嶽倒為輕。 眼花耳熱後，意氣素霓生。 救趙揮金槌，邯鄲先震驚。 千秋二壯士，烜赫大梁城。 縱死俠骨香，不慚世上英。 誰能書閣下，白首太玄經。 賞析 夫趙地俠客，英武豪縱， 十步可殺一人， 千里無人能敵。 然，淡薄名利，深藏身名。 「趙客縵胡纓， 吳鉤霜雪明。 銀鞍照白馬， 颯沓如流星」四句， 俠客形氣躍然。 又褒侯嬴朱亥信陵之事， 以明己志， 再貶揚雄以加俠客。 太白借前人之事， 欲予明主， 俠行天下，成功就名。 賞析詩詞 商婦好梟尊 琳琅博古 世事 今乙巳年十月廿二（合西曆二〇二五年十二月十一日） 。 ※新之 是歲乃平年，日本紀為令和七年，中華民國紀為一百一十四年，朝鮮紀為主體一百一十四年。 十月十五（西曆十二月四日），臺灣有司諭，中土有軟體曰小紅書者，涉嫌詐欺，封禁一載。 十月十二（西曆十二月一日），俄羅斯以見制於泰西故，籌資無門，美金、歐元皆不可用，遂欲創行國債，以人民幣為準。 十月初七（西曆十一月廿六日），香港大埔宏福苑災，火勢滔天。 九月廿五（西曆十一月十四日），川普薄瑞貨之征，定為百抽十五。初，厚斂於瑞，高至三成九。瑞人苦之，乃許輸二千億美金。川普悅，遂有是命。 九月廿五（西曆十一月十四日），花旗國近物直騰貴，大統領乃下令，除牛肉、珈琲、水果諸食之稅，以抑其值。獨意麵不與焉。 九月廿五（西曆十一月十四日），日本有司數人，密告共同社曰：「首相方議，欲因修《國家安全保障戰略》等三書之際，乘機更易無核三則。」 世情概覽 維基諸策 維基中樞　 維基共享　 維基爾雅　 維基文庫　 治學利器 漢典　 國語辭典　 異體字庫　 粵音字庫　 中西曆法　 書格　 電子古籍　 漢籍文庫　 明清實錄　 朝鮮實錄　 研習寶庫 取自「https://zh-classical.wikipedia.org/w/index.php?title\u003d維基大典:卷首\u0026oldid\u003d425667」 二四語言 བོད་ཡིག 閩東語 / Mìng-dĕ̤ng-ngṳ̄ Cebuano Deutsch English Español Français 贛語 客家語 / Hak-kâ-ngî Italiano 日本語 한국어 Монгол Nederlands Polski Português Русский ئۇيغۇرچە / Uyghurche Tiếng Việt 吴语 Vahcuengh 中文 閩南語 / Bân-lâm-gí 粵語 尋 尋 維基大典:卷首 二四語言 入題",
