    "content": "Ir para o conteúdo Origem: Wikipédia, a enciclopédia livre. Boas-vindas à Wikipédia, a enciclopédia livre que todos podem editar. 1 161 823 artigos em português 8 274 editores ativos Ajuda Índice Perguntas Políticas Portais Arte Biologia Ciência Filosofia Física Geografia História Matemática Química Artigo em destaque O Prêmio Nobel de Literatura é um prêmio literário sueco que é concedido anualmente, desde 1901, a um autor de qualquer país que, nas palavras da vontade do industrial sueco Alfred Nobel, produziu \"no campo da literatura o trabalho mais notável em uma direção ideal\" (em sueco: den som inom litteraturen har producerat det utmärktaste i idealisk riktning). Embora os trabalhos individuais sejam às vezes citados como particularmente dignos de nota, o prêmio é baseado no conjunto da obra de um autor como um todo. A Academia Sueca é responsável por escolher o ganhador do prêmio e anunciar os nomes dos laureados, no início de outubro. É um dos cinco Prêmios Nobel estabelecidos pela vontade de Alfred Nobel em 1895. Em algumas ocasiões, o prêmio foi adiado para o ano seguinte. Não foi concedido em 2018, mas dois prêmios foram concedidos em 2019. (Artigo completo...) Destacados recentemente: Folklore (álbum de Taylor Swift) Vogue (canção de Madonna) Túmulo de Philippe Pot Compartilhe: Artigos destacados: 1536 • Artigos bons: 1956 Eventos atuais José Antonio Kast (imagem) eleito presidente do Chile. Ataque terrorista durante celebração de Chanucá na praia de Bondi, em Sydney, Austrália, causa a morte de 16 pessoas, incluindo um atirador. Clair Obscur: Expedition 33 vence em nove categorias no The Game Awards, incluindo Jogo do Ano. No automobilismo, Lando Norris sagra-se campeão mundial de Fórmula 1 pela primeira vez, enquanto McLaren ganha seu décimo Campeonato Mundial de Construtores. Eventos a decorrer: Guerra de Gaza (genocídio) • Guerra Rússia-Ucrânia (cronologia) • Guerra Civil no Sudão Mortes recentes: Rob Reiner • Glória de Matos • Frank Gehry • Olga Cardoso • Constança Cunha e Sá • Nicola Pietrangeli • Vasco Martins Mais eventos atuais • Sugestões Wikinotícias 15 de dezembro na história Oscar Niemeyer Dia de Zamenhof (Cultura esperantista) 1640 – D. João IV é coroado rei de Portugal, na restauração do trono contra o domínio espanhol e a União Ibérica. 1896 – Machado de Assis é proclamado 1.° presidente da Academia Brasileira de Letras. 1970 – A sonda soviética Venera 7 pousa com sucesso na superfície de Vênus. Nasceram neste dia… Nero (37–68) • Antoine Henri Becquerel (1852–1908) • Oscar Niemeyer (imagem) (1907–2012) Morreram neste dia… Johannes Vermeer (1632–1675) • Fernando de Saxe-Coburgo-Gota (1819–1885) • Walt Disney (1901–1966) Ver mais • Outros dias: 13 • 14 • 15 • 16 • 17 • Ver todos Sabia que... … Sobhuza II de Essuatíni (imagem) tem o reinado mais longo documentado na história, com 83 anos de duração, tendo tido 70 esposas e mais de 200 filhos? … a edição inicial de 2001 do Dicionário Houaiss da Língua Portuguesa era tão grande que teve que ser impressa na Itália? … em 2019, a Macedónia do Norte acrescentou \"do Norte\" ao seu nome em um acordo para dar fim a décadas de disputas envolvendo o país e a região homônima grega? … é possível casar-se legalmente com uma pessoa morta na França perante aprovação do presidente? … em 2015, a sexta-feira foi definida como o padrão de dia da semana para o lançamento de singles e álbuns musicais? Índice geral • Sugestões Imagem do dia Filhote de duas semanas de hamster-sírio (Mesocricetus auratus) de olhos vermelhos. De alguns exemplares capturados na Síria durante uma expedição científica descendem os muitos hamsters domésticos, comercializados como cobaias de laboratório e animais de estimação. (resolução original: 3 339 × 2 227) Compartilhe: Índice geral • Commons Sobre a Wikipédia A Wikipédia é um projeto de enciclopédia colaborativa, universal e multilíngue estabelecido na internet sob o princípio wiki. Tem como propósito fornecer um conteúdo livre, objetivo e verificável, que todos possam editar e melhorar. O projeto é definido pelos princípios fundadores e o conteúdo é disponibilizado sob a licença Creative Commons BY-SA e pode ser reutilizado sob a mesma licença, desde que respeitando os termos de uso. Todos podem publicar conteúdo on-line desde que criem uma conta e sigam as regras básicas, como verificabilidade ou notoriedade. Todos os editores da Wikipédia são voluntários e integram uma comunidade colaborativa, sem um líder, onde coordenam esforços em projetos temáticos e espaços de discussão. Dentre as várias páginas de ajuda à disposição, estão as que explicam como criar um artigo ou editar um artigo. Em caso de dúvidas, não hesite em perguntar. Debates e comentários sobre os artigos são bem-vindos. As páginas de discussão servem para centralizar reflexões e avaliações sobre como melhorar o conteúdo da Wikipédia. Importante! Princípio da imparcialidade Versões do português Direitos de autor Normas de conduta Coisas a não fazer Escrevendo ",
