    "title": "Cameron machine - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Political party in the United States Cameron machine Leader • Simon Cameron • J. Donald Cameron • Matthew Quay • Boies Penrose Founded c. 1860 Dissolved c. 1930s Ideology • Anti-slavery • Grantism • Conservatism • Fiscal conservatism • Pro-spoils system • Protectionism • Hard money Political position Right-wing National affiliation Republican Party Stalwarts (1880) Politics of the United States Political parties Elections The Cameron machine, later known as the Quay machine[1][2] and Penrose machine,[3] was a Republican political machine in Pennsylvania that controlled much of the state\u0027s politics for seven decades. Founded by antislavery Know Nothing and Republican Simon Cameron, it passed into control of his son J. Donald Cameron, later controlled by Matthew Quay and finally Boies Penrose. The organization was financially and fiscally conservative, favoring higher protective tariffs and representing business interests. The elder Cameron\u0027s leadership skills were contrasted with the weaker political abilities of his son Donald, and several Republican defeats resulted in a transfer of machine power into the hands of Quay, who utilized the machine\u0027s powers with shrewd effectiveness. The baton of machine boss was then passed for a final time to Penrose, whose death ended its power and influence. History and timeline [edit] Simon Cameron establishes the machine [edit] Simon Cameron, namesake of the machine The state Republican machine of Pennsylvania was first established by Simon Cameron,[4] originally a Jacksonian Democrat who became a Know Nothing and eventually joined the Republican Party. Cameron, who previously in 1845 organized a coalition of Whigs, anti-Catholic activists,[5] and protectionist Democrats that elected him to the Senate, rode the coattails of the rising Republican Party influence around 1860 to form the machine that would prove influential for decades to come.[6] Previously a businessman, Cameron wielded power over state jobs and contracts to exert and cement his influence after his election to the United States Senate in the 1866 elections.[4] Among patronage decisions, he transacted loans from Middletown Bank to loyal Republicans. Baton of machine boss handed from father to son [edit] In 1877, J. Donald Cameron became a U.S. senator from Pennsylvania following the resignation of his father. Despite obtaining such an important post in addition to assuming leadership of the elder Cameron\u0027s political machine (which resulted in effectively being the Pennsylvania Republican Party \"boss\"),[7] his political skills were lacking, in addition to charisma.[8] While a consistent party loyalist, Cameron seldom spoke on the Senate floor or introduced legislation.[7] Although generally quiet, Cameron was outspoken in his support for protective tariffs,[8] a position held by most Republicans. During the 1880 presidential election, Cameron served as the chairman of the Republican National Committee. Aligned with congressional conservative stalwarts led by Roscoe Conkling,[9] he supported nominating former president Grant to run for an unprecedented, non-consecutive third term.[10] Portrait of Don Cameron In 1882, factionalism divided the Pennsylvania GOP and handed a victory to Democrats when roughly 40,000 Liberal Republicans, pejoratively deemed \"Half-Breeds\" by the Republican machine, bolted from the party in the gubernatorial election that year to vote for an \"Independent Republican\" candidate.[7] Several years later in the mid-1880s, Cameron was replaced as machine leader by Matthew S. Quay, who proved to surpass the former in influence and capabilities.[8] The Federal Elections Bill of 1890 introduced by conservative Republican Massachusetts congressman Henry Cabot Lodge, Sr., narrowly passed the House by a party-line vote and faced a blockade in the Senate. Western liberal Republicans who advocated bimetallism, later known for forming the Silver Republican Party, opposed the bill under the belief that the stance would draw support from Southern Democrats into their pro-free silver cause, while some Northern pro-business Republicans such as Cameron and Quay emphasized protective tariffs.[11] Although the Pennsylvania senatorial duo did not oppose the legislation, they prioritized the tariff issue and did comparably little to help pass the Lodge bill, which ultimately died as a result of the blockade. In the 1896–97 elections, Cameron declined to run for another term due to the increasing intraparty power of Quay.[12] Quay replaces Don Cameron as boss [edit] Amidst discord among the Pennsylvania GOP, Quay developed a shrewd strategy to prevent another party demise. He raided the state treasury, exerting sharp control over the office and dispensed patronage in the forms of loans to political allies.[13][14] Quay would state on the matter: I don\u0027t mind losing the governorship or a legislature now and then, but I always need the state treasuryship. ",
