    "content": "Jump to content From Wikiversity Welcome to Wikiversity Set learning free with 37,098 learning resources and growing. Arts • Humanities • Mathematics • Medicine • Science • Social Sciences • Technology • WikiJournals • Schools • Courses • Portals • Help Welcome Wikiversity is a Wikimedia Foundation project devoted to learning resources, learning projects, and research for use in all levels, types, and styles of education from pre-school to university, including professional training and informal learning. We invite teachers, students, and researchers to join us in creating open educational resources and collaborative learning communities. To learn more about Wikiversity, try a guided tour, learn about adding content, or start editing now. Today\u0027s Featured Project Electric Circuit Analysis Electric Circuit Analysis deals with the fundamentals of electrical circuits, their components and the mathematical tools used to represent and analyse electrical circuits. By the end of the course, the student will be able to confidently analyse and build simple electrical circuits. Parts of this course include: Circuit Variables, Circuit Elements, Simple Resistive Circuits, Techniques of Circuit Analysis, Kirchhoff\u0027s Voltage Law problems, Kirchhoff\u0027s Current Law problems, Nodal Analysis problems, Mesh Analysis problems. The course comprises a total of about 25 pages with a high layout design quality. Course creators from other disciplines can use this course for ideas about organisation, layout and design of wiki courses. The course itself is suitable for non-specialists from secondary education upwards. Visit this resource · see more featured content view · discuss Educational Picture of the Day Battle of the Little Big Horn This map shows the battle of the Little Big Horn in 1876, at which the Sioux defeated the US Army under General Custer. Battle plans of many other battles are available to use in educational resources. Click on the image for a full size version which you can freely re-use and modify. Print it and use it for your lessons, integrate it into your pages on Wikiversity, or use it in other learning resources and websites. Use the links below to find more images like this one. Battle maps - Battle paintings - Military maps Indigenous peoples of North America - Images relating to the history of the United States History images in general This image is a part of the Educational Media Awareness Campaign, raising awareness among educators about the availability and usage of millions of free internet media in education. view · discuss News 2025 December 4: Association Between Screen Time and Sleep: An Online Survey is now available for viewers. 2026 TBD Wikiversity\u0027s sister projects Wikiversity is hosted by the Wikimedia Foundation, a non-profit organization that also hosts a range of other multilingual and free-content projects: Wikipedia Wikipedia Free-content encyclopedia Wikibooks Wikibooks Free textbooks and manuals Commons Commons Shared media repository Wiktionary Wiktionary Dictionary and thesaurus Wikiquote Wikiquote Collection of quotations Wikinews Wikinews Free-content news Wikispecies Wikispecies Directory of species Wikisource Wikisource Free-content library Wikivoyage Wikivoyage Open travel guide Meta-Wiki Meta-Wiki Wikimedia project coordination MediaWiki MediaWiki Free software development Wikidata Wikidata Free knowledge base Wikiversity is also available in other languages: Deutsch • Français • Русский • 中文 • Italiano • Čeština • Português • Español • العربية • Svenska • Slovenščina • Suomi • Ελληνικά • हिन्दी • 한국어 • 日本語 • Other Retrieved from \"https://en.wikiversity.org/w/index.php?title\u003dWikiversity:Main_Page\u0026oldid\u003d2175209\" Category: Main Page 16 languages العربية Čeština Deutsch Ελληνικά Español Suomi Français हिन्दी Italiano 日本語 한국어 Português Русский Slovenščina Svenska 中文 Edit links Search Search Wikiversity:Main Page 16 languages Add topic",
