    "content": "Чулоацамага гӀó Википеди материал Марша доaгӀалда Википеде, хӀаране тоаде мегаш долча лоӀамеча энциклопеде. ХӀанз Википеде чу 2411 статья я гӀалгӀай меттала. Тахан оагӀой бетта 10-гӀа ди да, 2025 шу, кхаьра, 02:21 (кэш) Лаха 2411 статьянна юкъе Чулоацам Ди • Нах • Ӏилма • ГӀалгӀайче ГӀАЛГӀАЙ МОТТ КъамаьлӀоморг Дошлоргаш БЕРАШТА Хержа статья «Письмо» — йизза метраж йола гӀалгӀай кино да. Ӏамархананаькъан Амура даьккхад 2024 шера. Советий хана 1970-ча шерашка боккъонца хиннача хӀамашца бух болаш даьккхад. Кино 2024 шера гурахьа арадала дезаш да. Из даккхар а арахецар а хоттадаьд ГӀалгӀай Республика хьахинна 100 шу дузаш дездарца. Премьера Магасе хила езаш я. Кино даьккхар гӀалгӀай къаман киностуди я «INKI» яхаш. Кино доаккхаш вола режиссёр Ӏамархананаькъан Амур ва. Киноцара болх цар болабенна хиннаб хьалхагӀа лоаца метраж йола «Sajti — Zouli voh» («Сайти ― сын Зовли») яхаш кино даккхарца. ДӀахо деша… архив ло Укх дийнахьа 10/12 1508 — Вендигенна духьале яргйолаш Камбрера лига хьаяьй. 1520 — Мартин Лютера наха хьалхашка папан Exsurge Domine яха булла доагадаьд. 1887 — Эрсаша туркий Плевна пхье яьккхай эрсий-туркий тӀем тӀа. 1901 — хьалхара Нобела премеш еннай. 1930 — фаьренгий Ӏаьдало ахбӀаь шера Луис Бунюэля «Дошо бӀаьшу» яха кино хьокхар дийхкад. 1936 — Эдуард VIII-вар ингалсий монархашта юкъе духхьашха ший лоӀаме а волашпаччахьа гӀандах хаьдав. 1948 — Цхьанкхийттача Къамий Организаце Массане юкъара йола сага бокъоний деклараци кхайкаяьй. 1993 — Doom яха компьютераш тӀара ловзар арадаьннад. 1997 — Казахехьен нанагӀал Акмоле хьалйихьай. • • • Таханара сурт Ло:Potd/2025-12-10 (inh) • • • Таханара мультимедиа Ло:Motd/2025-12-10 (inh) • • • Керттердар ГӀАЛГӀАЙ МОХК / ГӀАЛГӀАЙ МОТТ / ГӀАЛГӀАЙ КЪАМ товшхал • эздел • йоазув • литература • мифологи • даар • цӀераш • мукъам • илли • халхар • дувхар • курхарс • архитектура • гӀалаш • ердаш • маьлха-кашамаш • тархьар • дзӀардзувкъой • шахьараш • тайпаш • Магас • Буро • Наьсаре • Кавказера тӀом • Наьсарен гӀовттам • Тийрка область • ГӀалгӀай округ • Бурон округ • Шолжа отдел • Шолжа округ • Наьсарен округ • Лоаман АССР • ГӀалгӀай автономе область • Нохч-ГӀалгӀай АССР • 1944 мехках бахар • 1973 гуллам • ГӀалгӀай Республика • 1992 мехках бахар • 2018 гуллам Проект «ГӀалгӀай ханорг» наджгоанцхой бутт • саькура бутт • тушола бутт • бекарга бутт • маьтсела бутт • аьтинга бутт • кӀимарса бутт • маьцхали бутт • тов бутт • ардара бутт • лайчилла бутт • оагӀой бутт Проект «ГӀалгӀайчен географи» буне • дуне • лоамаш • хиш • хьасташ • пхьеш • шахьараш • юрташ • кхаьллаш Керда лустам язбе шун безам бале, лохе боаллача баьссача могӀара чу шоай лустама цӀи Ӏояз а яь, «Лустам кхолла» яздаьча тоӀабе. Теркалде! ГӀалгӀай «Ӏ» яхача алапа́ когаметта «1» (цаӀ) яха дагарг ма увттае N, е латиний «I» («ай»), «l» («эл») яха алапаш а ма увттаде N ГӀалгӀай Википеди болх беш я 2018 шера бекарга бетта 18 дийнахьа денз. Укх мазаоагӀона тӀа болчул совгӀа цун болх гойташ ба массехк моттиге: youtube · instagram · telegram · facebook Хьаст — «https://inh.wikipedia.org/w/index.php?title\u003dКерттера_оагӀув\u0026oldid\u003d67152» КъайлагӀа оагӀат: Википеди:ХӀара сахьат мел доал кэш ӀоцӀенлу оагӀонаш 44 мотт العربية Azərbaycanca Башҡортса Беларуская Беларуская (тарашкевіца) Български Нохчийн Čeština Чӑвашла Dansk Deutsch Ελληνικά English Español Eesti فارسی Suomi Français עברית Magyar Հայերեն Italiano 日本語 ქართული Қазақша 한국어 Лезги Lietuvių Latviešu Nederlands Norsk bokmål Ирон Polski Português Română Русский Саха тыла Српски / srpski Svenska Türkçe Татарча / tatarça Українська Tiếng Việt 中文 Лахаp Лаха Керттера оагӀув 44 мотт Тема тӀатоха",
