    "url": "https://cdo.wikipedia.org/wiki/T%C3%A0u_Hi%C4%95k",
    "title": "Wikipedia - Cê̤ṳ-iù gì Báik-kuŏ-ciòng-cṳ̆",
    "content": "跳至內容 Chók-cê̤ṳ Wikipedia chiék-uâng Tàu Hiĕk （Bàng-uâ-cê） — 頭頁 （漢字） 切換 Wikipedia nè̤ng nè̤ng dŭ â̤ sāi siā gì báik-kuŏ-ciòng-cṳ̆ Hāi năk báik chiŏng, iū ṳ̀ng nāi dâi. —Lìng Cáik-sṳ̀ Gáu gĭng-dáng dŭ-liāng ô 16,694 piĕng ùng-ciŏng Huăng-ngìng nṳ̄ guŏng-lìng Bànguâpedia, Mìng-dĕ̤ng-ngṳ̄ gì Wikipedia! Wikipedia sê cê̤ṳ-iù gì báik-kuŏ-ciòng-cṳ̆, găk cŭ-uái, muōi siŏh ciáh nè̤ng dŭ â̤-sāi góng-hióng cê-gă gì dĭ-sék. Â̤ báik gōng Hók-ciŭ-uâ hĕ̤k-ciā Hók-ăng-uâ mâ̤? Huòi nṳ̄ gó găk lā̤ dīng sié-nó̤h?! Ká̤-ká̤ cà̤ lì chăng siŏh kă! Hiêng-káik-sì, Bànguâpedia dŭ-liāng ô 16,694 piĕng ùng-ciŏng. Nē̤ng-gă sāi Mìng-dĕ̤ng-ngṳ̄ gì Bàng-uâ-cê gâe̤ng Háng-cê cà̤ siā ùng-ciŏng. Ciŏng-uâng có̤ sê-hō̤ sê-ngài? Ô sié-nó̤h é-giéng gióng-ngiê kī-dâe̤ng nṳ̄ gáu Duâi chéu â kó̤ làu uâ. 平話字是19世紀西方傳教士替閩東語福州話設計其羅馬文字。看儥來？無敆涉，Wikipedia教汝！ Mò̤ Bàng-uâ-cê gì páh-cê-huák? Mò̤-găh-siăh, kī-dâe̤ng nṳ̄ kó̤ cŭ-uái hâ-cái! Min Dong language (Eastern Min) is one of the Sino-Tibetan languages spoken natively in the eastern part of Fujian Province (namely Fuzhou, Ningde and Matsu). Not a Min Dong speaker? Please come here if you have any comments or questions. Bō̤-ciéng hō̤ ùng Mìng-kiŏk, iâ hô̤ lā̤ Hók-ciŭ-hié, sê Hók-ciŭ dĕk-sáik gì siŏh cṳ̄ng kiŏk cṳ̄ng, sāi Hók-ciŭ-uâ chióng, Hók-ciŭ-uâ niêng-băh. Găk Dòng-dièu gì sèng-âu, Hók-ciŭ cêu ô „gŏ̤-ū báik-hié“ gì iēng-chók kó̤ lāu. Nàng-sóng sèng-âu nàng-hié dâi-dŏng gì «Diŏng-hiĕk Câung-ngòng», cêu sê kĕk Hók-ciŭ báh-sáng gì „Hók-ciŭ-gŏ̤“ gâe̤ng „Hók-chiăng-gŏ̤“ lì có̤ kuóh-bà̤ gì. Mìng-dièu Uâng-lĭk 37 nièng (1609 nièng), Hók-ciŭ chók-sĭng gì guăng-nguòng Cò̤ Hŏk-cuòng ké̤ṳk huòng-dá̤ dṳ̆k diōng chió. Ĭ diŏh Hùng-dòng cū-chió cū-cék hié-băng, chiāng ṳ̀-sê̤ṳ kó̤ hŭ-uái tiăng kiŏk. Ĭ cĭng-tŭng ĭng-lŭk, cháung-cáuk chók lì siŏh cṳ̄ng sék-hăk sāi Hók-ciŭ-uâ chióng gì kiŏng, bék-nè̤ng dŭ giéng-gáe̤k ciā kiŏng mâ̤ ngài, gó̤ cuòi hô̤ lā̤ „ṳ̀-lìng-băng“. Muāng-chĭng diē guăng ī-hâiu, Cò̤ Hŏk-cuòng cê̤ṳ-sák, ciā kiŏng cêu mâng-mâng mò̤ nè̤ng chióng kó̤ lāu. Dùng-sì bô ô Gŏng-să̤ gì ĭk-iòng-kiŏng diòng gáu Hók-ciŭ lì. Ciā hié-băng siŏh-chék-ché̤ṳ biék-biék-dâe̤ng kó̤ iēng-chók, gó-chṳ̄ hô̤ lā̤ „gĕ̤ng-hù-băng“. Ciā „gĕ̤ng-hù-băng“ chióng-hié ciòng sāi „tū-guăng-uâ“(guăng-uâ gì cê sāi Hók-ciŭ-uâ gì ĭng lì tĕ̤k), sèng-dài chióng, âu-dài bŏng-kiŏng, lò̤-gū kuāng-kuāng-giéu, tiăng lā̤ iā nâu-iĕk, báh-sáng dŭ cêng-kó̤ hī-huăng. Dáng-sê ciā „tū-guăng-uâ“ diŏh báh-sáng dâi-dŏng mò̤ niŏh-uâi nè̤ng tiăng â̤ huòi-é, ô nè̤ng cêu dò̤ lā̤ sāi Bàng-uâ (Hók-ciŭ-uâ) lì chióng-báh, „bàng-gōng-hié“ cêu ciŏng-uâng săng-sēng kó̤ lāu. \u003e\u003eSié lŏ̤h tĕ̤k... gó sâ̤ – uâng siŏh piĕng Nṳ̄ â̤ báik mâ̤? 2022 nièng nièng-dā̤ Qatar gṳ̄-bâ̤ing guó sié-nóh kă-giù bī-suói? Ngò̤-lò̤-sṳ̆ găk 2022 nièng gâ̤eng Ukraine kăi-sṳ̄ páh sié-nóh ciéng-cĕng (dù)? Diòng-siók ô siŏh-cṳ̄ng có̤ ôi-sĕng sāi gì nó̤h, huăng-giāng sìng-mā â̤ dò̤ kó̤ kià kă-bōng-giâ buŏi, găk Nĭk-buōng ĕng siŏh-báh-nièng bô kō̤-ī biéng-có̤ sìng-mìng. Cuòi sê sié-nó̤h? Ĭng-guók gì sié-nó̤h sĭng-ùng ciŭ-bó̤ â̤ buŏng 8 bĭk bēng-buōng hióng cuòng-giù huák-hèng? Gó-dā̤ Hók-ciŭ-nè̤ng ô cê-gă gì chiū-sié biēu-sê só-cê. Ciŏng-ciŏng có̤ lī? gó sâ̤ – gĕng-sĭng – còng-dáung Cê-mō̤ sáuk-īng Nâ sê nṳ̄ mâ̤ báik wiki ngṳ̄-huák, có̤i hō̤ sĕng kó̤ să-buàng káh-dièu lâ. Cê-mō̤ sáuk-īng: A B C CH D E F G H I J K L M N NG O P Q R S T U V W X Y Z Dĕk-sṳ̀ hiĕk: Sū-iū hiĕk-miêng Sū-iū lôi-biék Dŏng-nièng gĭng-dáng Gĭng-dáng sê 2025 nièng 12 nguŏk 9 hô̤, bái-nê. (sáuk-sĭng) 12 nguŏk 9 hô̤: Tanzania: dŭk-lĭk-nĭk 1425 nièng: Gáu-huòng Martinus 5-sié mêng-lêng găk Bī-lé-sì gióng-lĭk Leuven Tiĕng-ciō-gáu Dâi-hŏk, cuòi sê gĭng-dáng sié-gái siông lĭk-sṳ̄ cô̤i dòng gì tiĕng-ciō-gáu dâi-hŏk. 1961 nièng: Tanganyika téng Ĭng-guók dŭk-lĭk. 1968 nièng: Mī-guók huák-mìng-gă Douglas Engelbart tàu-huòi gŭng-kăi diēng-sê chṳ̄-biĕu(dù), chiĕu-ùng-buōng (Hypertext), dù-hìng ê̤ṳng-hô gái-méng (GUI) dēng-dēng siék-gié. 1968 nièng: Sié-gái Ôi-sĕng Cū-cék sŏng-buó uòng-ciòng gāi-giók tiĕng-huă gāng-niēng, cuòi sê gáu hiêng-câi cī mì-ék siŏh ciáh téng buōng-cék siông miĕk lâi gì ìng-lôi diòng-niēng-bâng. gò̤-lòng nguŏk – gó sâ̤ Cáuk-gă dù-piéng Săng-huŏng-chék-háe̤ng sê Hók-ciŭ Gū-làu-kṳ̆ Nàng-âu-gă̤ biĕng-dău 3 dèu huŏng gâe̤ng 7 dèu háe̤ng gì tūng-chĭng. Ciā 3 dèu huŏng dŭ diŏh Nàng-âu-gă̤ gì să̤ hióng, áng iù báe̤k gáu nàng sông-sê̤ṳ sê Ĭ-gīng-huŏng, Ùng-ṳ̀-huŏng gâe̤ng Guŏng-liŏh-huŏng; 7 dèu háe̤ng dŭ găk dĕ̤ng hióng, iù báe̤k gáu nàng sông-sê̤ṳ sê Iòng-giò-háe̤ng, Lòng-guăng-háe̤ng, Ták-háe̤ng, Uòng-háe̤ng , Ăng-mìng-háe̤ng, Gṳ̆ng-háe̤ng, Gék-puòi-háe̤ng. Săng-huŏng-chék-háe̤ng diē-sié ô iā sâ̤ lĭk-sṳ̄ ìng-ŭk gì chió, ciā chió dŭ iā ô dĕk-sáik. 2009 nièng 6 nguŏk 9 hô̤, Săng-huŏng-chék-háe̤ng dŏng-sōng „Dṳ̆ng-guók 10 duâi Lĭk-sṳ̄ Ùng-huá Mìng-gă̤“, dáik gáu có̤i sâ̤ piéu. 2010 nièng, ké̤ṳk diâng có̤ Guók-gă 4A-ngék lṳ̄-iù gīng-kṳ̆, 2015 nièng bô gāi có̤ 5A-ngék. gó sâ̤ – uâng siŏh ciáh Siâ-huôi Céng-dê - Gáu-ṳ̆k - Gĭng-cá̤ - Huák-lŭk - Ìng-ŭk - Lĭk-sṳ̄ - Tā̤-ṳ̆k Ùng-huá Cŭng-gáu - Diék-hŏk - Hŭng-sṳ̆k - Ĭng-ngŏk - Īng-sĭ",
