    "content": "Saltar ao contido Na Galipedia, a Wikipedia en galego. Dámosche a benvida á Galipedia A enciclopedia libre que calquera pode editar sábado, 13 de decembro de 2025 Versión para móbiles Nesta versión en galego, que comezou o 8 de marzo de 2003, xa temos 228 281 artigos. Benvida COMOs Preguntas frecuentes Comunidade Políticas Artigos de calidade Axuda Artigo destacado Minecraft é un videoxogo de mundo aberto tipo sandbox creado orixinalmente polo deseñador e programador sueco Markus \"Notch\" Persson e desenvolvido e publicado posteriormente pola empresa fundada por el, Mojang. Os aspectos creativos e de construción de Minecraft permítenlles ós xogadores construír elementos a partir de cubos con diversas texturas nun mundo en tres dimensións xerado por procedementos. Outras actividades do xogo inclúen a exploración, a recolección de recursos, a confección de obxectos e o combate. Dispón de varios modos de xogo, incluíndo un modo de supervivencia no que o xogador debe conseguir recursos para construír o mundo de xogo e manter a súa saúde, un modo creativo no que os recursos son ilimitados e o xogador ten a capacidade de voar, un modo de aventuras que permite xogar niveis e mapas creados por outros xogadores e un modo espectador no que os xogadores poden voar e observar o mundo pero sen interactuar con el. A versión para PC do xogo destaca pola súa comunidade de modding. Outros artigos destacados • Artigos de calidade Sobre Galicia Ricardo Courtier, nado na Coruña o 10 de marzo de 1865 e finado en Ourense o 10 de decembro de 1922, foi un músico e compositor galego. Nado nunha familia de músicos, é considerado o membro máis salientable da terceira xeración de músicos da saga Courtier. Logo de finalizar a súa formación instalouse na Pobra de Trives, onde foi director da banda de música. Foi precisamente nesta vila ourensá onde desenvolveu un intenso labor fundando diversas agrupacións e compoñendo obras que serían interpretadas por estas. Posteriormente trasladouse coa súa familia á cidade de Ourense, onde residiu ata o seu falecemento, e onde foi director da Banda de Música Municipal. A súa obra salienta pola influencia da música tradicional galega, con harmonías sinxelas e formas típicas da música popular. Ademais do seu labor como compositor, Ricardo Courtier realizou arranxos para as distintas agrupacións que liderou. Outros artigos destacados sobre Galicia • O mes de decembro na cultura popular galega Tal día coma hoxe no ano... 1545, comeza o Concilio de Trento en Trento, Italia. 1937, durante a Segunda Guerra Chinesa-Xaponesa remata a Batalla de Nanjing coa vitoria das tropas xaponesas, dando comezo o Masacre de Nanjing. 1959, Makarios III, arcebispo da Igrexa Ortodoxa Chipriota, convértese no primeiro presidente de Chipre. 1981, o xeneral Wojciech Jaruzelski declara a lei marcial en Polonia para impedir que Solidaridade desmantele o sistema socialista. 1996, Kofi Annan é elixido Secretario Xeral das Nacións Unidas. 2003, Saddam Hussein (na imaxe), ex-presidente de Iraq, é capturado preto de Tikrit polas tropas estadounidenses. Hoxe é o Día da República en Malta (1974). Máis efemérides do día de hoxe • Outras Efemérides destacadas Imaxe do día Lago Kinney e monte Whitehorn. Vexa o artigo Parque provincial Monte Robson Outras imaxes destacadas • Imaxes destacadas en Commons Presentación A Wikipedia é unha enciclopedia universal en liña multilingüe, colaborativa e gratuíta. O propósito da Wikipedia é fornecer un contido libre, obxectivo e verificable que todas as persoas poidan editar e mellorar. O proxecto está baseado en cinco principios básicos, todo o contido está dispoñible baixo a licenza Creative Commons BY-SA e pode ser copiado e reutilizado baixo esta mesma licenza. Benvida • Índice da Axuda Participación Podes consultar a Axuda e a Guía para obter máis información de como participar, nas que atoparás información de como comezar a colaborar, editar artigos e usar imaxes libres. En caso de dúbidas síntete libre de preguntar. COMOs • Preguntas máis frecuentes Comunidade De acordo coas nosas estatísticas, temos un total de 161 812 contas de usuario rexistradas na Galipedia, e entre elas 535 estiveron activas durante o último mes. Todas as persoas que editan a Galipedia son voluntarias, integrando unha comunidade colaborativa e coordinando os esforzos por medio de proxectos temáticos e diversos espazos de conversa. Portal da comunidade • Políticas e normas Meta-Wiki Meta-Wiki Coordinación Wikimedia Commons Commons Multimedia Wiktionary Galizionario Dicionario Wikibooks Galilibros Libros Wikisource Galifontes Documentos Wikiquote Galicitas Citas Wikispecies Wikispecies Especies Wikinews Wikinews Novas Wikiversity Wikiversity Aprendizaxe Wikivoyage Wikivoyage Viaxes Wikidata Wikidata Datos MediaWiki MediaWiki Desenvolvemento Obtido de «https://gl.wikipedia.org/w/index.php?title\u003dPortada\u0026oldid\u003d7053480» Categoría: Índice Categoría agochada: Wikipedia:Artigos con extractos 40 linguas Aragonés العربية Asturianu C",
