    "title": "Wikipédia",
    "content": "Preskočiť na obsah z Wikipédie, slobodnej encyklopédie Vitajte vo Wikipédii, slobodnej encyklopédii, ktorú môže upravovať každý. Dnes je pondelok 15. decembra 2025. Slovenská verzia má momentálne 257 132 článkov. O Wikipédii • Príručka • Pomoc Najlepšie články • Portály • Kategórie • A – Z index 15. december Sediaci býk Meniny má Ivica. 1791 – bola prijatá Listina práv a stala sa súčasťou Ústavy Spojených štátov 1852 – narodil sa Henri Becquerel, francúzsky inžinier a fyzik, spoluobjaviteľ rádioaktivity, laureát Nobelovej ceny († 1908) 1860 – narodil sa Niels Ryberg Finsen, dánsky lekár, laureát Nobelovej ceny († 1904) 1890 – zomrel Sediaci býk, náčelník indiánskeho kmeňa Siouxov (* asi 1831 – 1837) 1923 – narodil sa Freeman Dyson, britsko-americký teoretický fyzik a matematik, popularizoval koncept Dysonovej sféry († 2020) 1939 – v Atlante sa uskutočnila premiéra filmu Odviate vetrom 1966 – zomrela Želmíra Gašparíková, slovenská jazykovedkyňa a bibliografka (* 1901) 1978 – americký prezident Jimmy Carter oznámil, že USA uznávajú ČĽR a prerušujú diplomatické vzťahy s Čínskou republikou 2013 – zomrela Joan Fontaine, britsko-americká herečka, držiteľka Oscara (* 1917) Ďalšie udalosti • Archív • Zoznam historických výročí Aktuality ruská invázia na Ukrajinu chronológia Maryja Kalesnikavová 13. december – Bielorusko prepustilo 123 politických väzňov vrátane aktivistky za občianske práva Maryje Kalesnikavovej a nositeľa Nobelovej ceny za mier Alesa Biaľackého. 09. december – prezident Českej republiky Petr Pavel vymenoval na Pražskom hrade Andreja Babiša, predsedu hnutia ANO, za nového premiéra ČR. 09. december – ruská kozmická loď Sojuz MS-27 dopravila z Medzinárodnej vesmírnej stanice späť na Zem ruských kozmonautov Sergeja Ryžikova, Alexeja Zubrického a amerického astronauta Jonnyho Kima, pričom ich vystriedali dvaja ruskí kozmonauti a americký astronaut, ktorí na vesmírnu stanicu prileteli koncom novembra. 07. december – majstrom sveta Formuly 1 v sezóne 2025 sa stal britský pretekár Lando Norris, ktorý získal svoj prvý titul a zároveň priviedol svoj tím McLaren k zisku Pohára konštruktérov. 20. november – na rýchlostnej ceste R2 otvorili 9,1-kilometrový úsek Kriváň – Mýtna, ktorého súčasťou je 5 km dlhá mostná estakáda v údolí Krivánskeho potoka. 17. november – bývalá bangladéšska premiérka Hasína Wadžídová bola v neprítomnosti uznaná vinnou zo zločinov proti ľudskosti a odsúdená na trest smrti. Úmrtia: Władysław Siemaszko (106) Marian Kotleba (73) Oľga Feldeková (82) Frank Gehry (96) Géza Erdélyi (88) Pier Enrico Stefanetti (73) Udo Kier (81) Juraj Lexmann (84) Sally Kirklandová (84) Frederick Hauck (84) Ďalšie udalosti Odporúčaný článok V starovekom Grécku sa z keramiky (z pálenej hliny či terakoty) vyrábalo veľké množstvo nádob rozličných tvarov a funkcií, ktoré sa často prekrývali. Nevyrábali sa len nádoby, ako sú džbány a nádoby na pitie a jedlo, ale i také predmety, ako veľké kade, pece, sarkofágy, kanvice, vedrá, panvice, mažiare na drvenie, kozmetické skrinky, hračky, sochy, sošky, architektonické ozdoby, lampy a dekoratívne predmety (či nádoby). Keramické výrobky sa používali tiež pri obchodovaní, v remeslách a verejnom živote, napríklad ako hlasovacie urny, vodné hodiny, odmerky na tekutiny či sypké látky. Keramické nádoby, napr. čiernofigúrové panathenajské amfory sa dávali ako ceny pre víťazov na hrách. O nevšednom keramickom tovare s umeleckým zdobením sa toho vie viac, lebo sa často zachoval v hrobkách relatívne nepoškodený. Menej vedomostí je o obyčajných každodenných predmetoch, napríklad používaných v kuchyni, aj keď boli vo všetkých obdobiach zrejme bežnejšie. Vo vývinovej línii (chronologicky) sa výzdoba starogréckej keramiky rozlišuje na geometrickú, orientalizujúcu, čiernofigúrovú, červenofigúrovú, na bielom podklade a neskorú. Grécke keramické nádoby svojou štýlovou rozmanitosťou a rozšírením po celom gréckom svete (a jeho okolí) spôsobili bádateľom nemálo starostí. Tvar (typ) nádoby sa ale niekedy dal určiť pomerne jednoducho, občas bol nejaký antický termín použitý na základe dohody. Avšak o známych názvoch niektorých tvarov nádob, väčšinou tu ide atickú okrasnú keramiku, sa už dnes vie, že sú nesprávne (niekedy sa totiž vyrábali aj novinky typov váz, podľa požiadavok užívateľa). Rovnaký tvar mohla mať i celkom prostá nádoba i nádoba krásne zdobená. Najbežnejším zdobeným typom nádob boli poháre. Niektoré tvary nádob sa vyrábali aj z iných materiálov, napríklad z kameňa či kovu. celý článok... Archív • Dobré články • Najlepšie články Vedeli ste, že... …bývalý hráč bedmintonu a olympionik Li Jang sa v septembri 2025 stal prvým ministrom športu na Taiwane? …Gymnopaidia bola spartská slávnosť, podľa tradície založená v roku 669 pred Kr., zahŕňajúca tance a cvičenia mužov a nahých mladíkov …Sľažiansky potok tvorí hranicu území s Velčicami a Mankovcami a vlieva sa do Čerešňového potoka? …Majstrovstvá sveta vo futbale žien 2023 boli prvé, ktoré sa konali v dvoch štátoch Austrália a Nový Zél",
