    "url": "https://vo.wikipedia.org/wiki/Cifapad",
    "title": "Vükiped",
    "content": "Jump to content Se Vükiped: sikloped libik Benokömö ini Vükiped: sikloped libik, keli alan dalon redakön. Vükiped Volapükik äprimon tü 2004, yanula d. 27id; atimo pabevobons is yegeds 46,525. (Yegeds mödik pejafons medü nünömaprogram itjäfidik) Yeged adelo pevälöl Hiel John Ronald Reuel Tolkien (1892 yanul 3 – 1973 setul 2) äbinom pükavan, lautan ä profäsoran Linglänik, sevädik as lautan lebukas: The Hobbit e The Lord of the Rings (\u003d Söl Linas). Äbinom profäsoran Vöna⸗Linglänapüka in niver di Oxford de 1925 jü 1945 e poso profäsoran Püka e Literata Linglänikas de 1945 jü 1959. Äbinom romakatulan fiedik. Äbinom flen gudik hiela C. S. Lewis; bofikans ädutoms lü bespikagrup literatik no calöfik: el Inklings. Päcälom Büdan Roda Lamporäna Britänik (C.E.B.) fa jireg: Elizabeth II tü 1972 mäzul 28. Näi lebuks: Hobbit e Söl Linas, son ela Tolkien: Christopher Tolkien äpübom vobotis votik stabü penets fata okik. Vobots ats (kels keninükons eli Silmarillion famik) e votiks fomons kobo yumed gretik konotas, jenotemas e pükas pedatikölas, ed i yegedas literatik dö vol pefomälöl labü nem: Arda, e patiko Zänoda⸗Tal (in Linglänapük: Middle-earth (pedefomöl de fom pelinglänüköl vöda Vöna⸗Norgänapükik: Miðgarðr : län fa mens pabelodöl ma miteodem germik), kel kanoy dientifükön as „paset votik“ vola obsik. El Tolkien ägebom vödi: legendarium (\u003d konädem) tefü lautots valik at. El Tolkien binom veütik noe as lautan, abi as pükajafan: pato el Quenya ed el Sindarin, kels pledons rouli in Zänoda⸗Tal, dütons lü püks lekanik bäldikün e pesevikün. To lautans votik ipübons literatotis magälik bü el Tolkien, benosek legretik e flun lunüpik vobotas omik äkodons cedi pöpedik, das äbinom fatan literata magälik nulädik – u kuratikumo: fatan „magälaliterata löpik“ Hiel L. Sprague de Camp e votikans cedons omi „fatani magälaliterata nulädik“ kobü hiel Robert E. Howard (jafam ela Conan: Barbaran). Alo el Tolkien nendoto eflunom levemo lautotis posik e magälaliterati in valem. (Yeged lölik...) Magod avigo pevälöl Fotografot at jonon sämädi limanamazöta (söla: Gunnar Ljusterdal: Volapükan Svedänik) Diläda valemik feda Volapükaklubas: diläd bevünetik Volapükakluba valemik Nedänik, ün 1932 pädönuliföfüköl fa hiels Arie de Jong e J. G. M. Reynders Sr. Limans Diläda valemik, soäs limans Volapükakluba valemik, ägetons glato klubajäfidoti: Volapükagased pro Nedänapükans. Limanam ädulon yel bal. Sevol-li, ... ...das hiel Ebbe Vilborg äbinom lätikan, kel ädagetom diplomi tidana Volapüka (nüm: 1824) medü cifaladalebüd ün 1961? ...das mödiks votükamas in Volapük nulik hiela Arie de Jong ya pimobons fa Volapükans votik (a.s. hiel Auguste Kerckhoffs u hiel Rupert Kniele)? ...das Volapükaklub di Nürnberg, keli hiel Leopold Einstein äsüadükom ad vedön Sperantaklub balid, poso älüvom Sperantamufi ed äslopikom eli Ido? ...das Volapükamuf äninädon vomis jäfedik, soäsä jiel Henriette Wolter, kel päcälof fa Schleyer as cif balid pro Nolüda-Deutän, jiel Marie Johanna Verbrugh, kel älautof tidodemi gretik Volapüka pro Nedänans äsi penädis votik mödik, jiel Maria Tommasi, kel ädunof otosi pro Litaliyänans, u jiel Anna Petersen, kel ävedof presidan balid Volapükakluba di Thoreby (Danän) timü fün onik? (Ekö! lised jivolapükanas famik.) Leyans veütikün KLADS CIFIK: JENAV KAENAV LEKANS LIFAJENÄDS NOLAVS PÜKAV REL E FILOSOP SOGÄDAV SPOTS TALEDAV VOB VÜKIPEDIK: Kafetar – Komotanefaleyan – Lised lafabetik yegedas Yegeds ma jäfüd – Yegeds pevälöl – Magods pevälöl Yegeds gudik – Yegeds no pefipenöls – Liseds valasotik – Suk VÖDEMS IN VOLAPÜK VOLAPÜK.COM (resodatoped calöfik Vpa) Coged dela Dugädü jiflen el ‚filmstar‛ mu yunik: ‚Jane Smith‛ ävisitof neitaklubi in ‚Hollywood‛. Sematimülo el ‚Jane‛ ämutof gebön prifeti vo jöniko pestitöli kluba. Ab ekö! su völ detik prifeta äküpof pänoti, kel ämagom eli ‚Adam‛ in stad ti natädik. FIgabimabled smalik äkloton mani töbo. Dis pänot at äkanoy logön nunedi: ‚Tovolöd neföro figabimabledili!‛ ‚Jane‛ äbinof äs el ‚Eva‛ rafinik e so nuned at övedon mifät pro vomül: esuemol ya, das no äkanof damütön nuläli okik... No lunüpo posä itovof bledili e somo ilogedof genämis rumana bidäda obsik, klokülis ga mödiks äprimons ad tonön ed i horns mu mödiks äprmons ad bebladön. Bluviko vomül ägüflekof ed ämogolof vifiko se prifet... Ab in lecem pägetedof in stralamel fläkömalampadas bleinüköl, du musigalef kluba äpläyon fafari laodik e komanef äkaniton liäni lida: ‚Elogof mani lölik! Elogof mani lölik!‛ (Lektinakaenan ilüblinom kontagiani vü penid dis bledil su pänot prifetik e paratem in lecem kluba.) Fomälolsös bluvi ela ‚Jane Smith‛! Volapükagased (Zänagased pro Volapükanef) 1959, nüm: 5, pad: 22. Kis binon-li Volapük? Erklärungen für Deutschsprechende Explications pour francophones Objaśnienia dla polskojęzycznych Uitleg voor Nederlandstaligen Klarigo por Esperanto-parolantoj Clarification for English speakers Aclaración para hispanohablantes Объяснение для русскоговорящих Spiegazioni in lingua italiana 日本語話者の皆様へ Vükiped in yufapüks votik Esperan",
