    "url": "https://ks.wikipedia.org/wiki/%D8%A7%D9%8E%DB%81%D9%8E%D9%85_%D8%B5%D9%8E%D9%81%DB%81%D9%95",
    "title": "وِکیٖپیٖڈیا",
    "content": "مَوادَس کُن گٔژھِو وِکیٖپیٖڈیا پؠٹھٕ، اَکھ آزاد اِنسایکلوپیٖڈیا وِکیٖپیٖڈیاہَس پؠٹھ خٲر مَقدَم! اَکھ آزاد انسايكلوپيٖڈيا یَتھ مَنٛز ہَر کانٛہہ ہیٚکہِ اؠڈِٹ کٔرِتھ۔ 8٬416 مَضموٗن کٲشرِس مَنٛز۔ تۄہہِ چھا پَتا ... زِ وِکیٖپیٖڈیا چھُ اَکھ رَضاکار مَنصوٗب یُس وِکیٖمیٖڈیا فاوٗنڈیشَن تَحت چھُ یِوان۔ ... زِ کٲشرِس وِکیٖپیٖڈیاہَس پؠٹھ چھِ کُل 8٬416 مَضموٗن۔ ... زِ کانٛہہ تہِ ہیٚکہِ وِکیٖپیٖڈیا اؠڈِٹ کٔرِتھ۔ ... کٲشرِس وِکیٖپیٖڈیاہَس پؠٹھ چھِ کُل 13٬307 دَرٕج صٲرِف۔ ... زِ کٲشرِس وِکیٖپیٖڈیاہَس پؠٹھ چھُ گۄڈٕنیُٛک اؠڈِٹ 26 جُلَے 2004 پؠٹھ کَرنہٕ آمُت۔ خبرن مَنٛز تائی پو اپارٹمنٹ کمپلیکس منٛز نار اکِس اپارٹمنٹس لۆگ نار (تَصویٖر مَنٛز) ہونٛگ کونٛگ گس منٛز ییٚمؠ سٕتؠ 94 لوٗکھ موٗدؠ۔ آو دِلہِ منٛز گاڑِ دھماکہٕ پیش۔ امریکی مالیکیولر بائیولوجسٹ جیمٕز واٹسن، ڈی این اے ہُک ڈھانچہٕ شریٖک دریافت کرن وول، موٗد 97 وُہُر۔ یوٗ پی ایس ایئر لائنز پرواز 2976 لوئس ویل، کینٹکی اَمریٖکس پؠٹھٕ پرواز کرنہٕ پتہٕ گٔیہٕ حٲدثہٕ، یتھ منٛز کم از کم 12 نفر ہلاک گٔیہٕ۔ سٲبقہٕ ریاستہائے متحدُک نٲیِب صدٕر ڈِک چیٚنی موٗد 84وٲنٛسہِ منٛز. جٲری: غزہ جنٛگ یوکرینَس پؠٹھ روٗسی حملہٕ سوڈان خانہٕ جنٛگی یمہِ ؤریِچ وَفات اکھ مَضمون کٔرِو نامزد کٲشُر دۄپ لا اِلٰه اِلا الله صحی کۄٚرُم، وحی کۄرُم پنٔہ نُوی پان، وجوٗد ترٲوِتھ موجوٗد سۄٚرُم، ہر مۄکھہٕ ڈِیوٗنٛٹھم پنہٕ نُوی پان. — نُنٛدٕ ریٛۆش یَتھ تٲریٖخَس پؠٹھ (10 ڈیٚسَمبَر) وِکیٖپیٖڈیا:یَتھ تٲریٖخَس پؠٹھ/ڈیٚسَمبَر وِکیٖپیٖڈیاہَس پؠٹھ بَنٲوِو صَفہٕ کٲشرِس وِکیٖپیٖڈیاہَس پؠٹھ چھِ 8٬416 مَضموٗن دٕستِیاب یِم رَضاکار صٲرِفَو تَخلیٖق چھِ کٔرؠ مٕتؠ۔ اَگَر تُہؠ تہِ چھِو یَژھان مَضموٗن تَخلیٖق کَرٕنؠ۔ تَتھ خٲطرٕ کٔرِو گۄڈَے تَلاش سُہ مَضموٗن مُمکِن چھُ سُہ مَضموٗن ہیٚکہِ دٕستِیاب ٲسِتھ۔ اگَر سُہ مَضموٗن درٛاو نہٕ تَلاش کٔرِتھ تیٚلہِ کٔریَو بۄنہٕ کَنہِ مَضموٗنُک عُنٛوان دَرٕج تہٕ کٔریَو صَفہٕ تَحریر۔ مُنتَخٕب تَصویٖر(کیٚنٛہہ کالہٕ پَتہٕ وُچھِو) وانٛگَتھ مَندَر مجموعہ چھُ جموں و کشمیر، ہندوستانٕچ وادی کشمیر کِس گاندربل ضلعس مَنٛز ناراناگَس نزدیٖک وانٛگتھَس مَنٛز ہندو مندرَن ہٕنٛز یادگارَن ہُنٛد اَکھ مجموعہ. موٗجوٗدٕ ڈھانچہٕ اوس ٲٹھمہِ صٔدی عیسوی منٛز کارکوٹا خانٛدانٕکؠ للیتادتیہ مکتاپیڈا بنوومُت مگر وۄنؠ چھُ یہِ کھنڈر ۔ یہِ مٔنٛدِر چُھ ہِمالِیاہس منٛز اَکھ تھزرس پیٚٹھ الپائن جیٖل گنگابل جھیٖلس تام زِیارتن ہُنٛد شُروٗعٲتی مُقام ظٲہِر کَران، یَتھ کٲشِرِ ہیٚنٛدِ شِو سٕنٛز روزن جاے مانان چھِ۔ یہٕ فوٹو چُھ سائٹہٕ کس مغربی کمپلیکسک مرکزی مندر ہاوان۔ فوٹوگراف کریڈٹ: بسوراج کے کورکر; ایڈیٹ کٔرَن وول UnpetitproleX حال حالٕک : جَنوری دَسَمبَر تَمال باقٕے حِصہٕ وِکیٖپیٖڈیاہٕک چوک – وِکیٖپیٖڈیا خَبَر، باقٕے مَنصوٗبَن مُتعلِق مَعلوٗمات۔ چاے جاے – اَکھ مِلَن سار جاے ییٚتِؠتھ تُہِؠ ہیکِو پَنٕنؠ سَوال پرٕژِھت۔ اؠسَمبَلی – وِکیٖپیٖڈیاہَس مُتعلِق بَحَث کَرنہٕ خٲطرٕ جاے. یَتھ جاے تَکنیٖکی، حِکمَتہِ عَملی، تہٕ باقٕے وِکیٖپیٖڈیا شعبَن مُتعلِق کَتھ باتھ چھِ یِوان کَرنہٕ۔ وِکیٖپیٖڈیا لۄکٕٹ مَنصوٗب وِکیٖپیٖڈیا سُنٛد میزبان چھُ وِکیٖمیٖڈیا فاوٗنڈیشَن، اَکھ غٲر مَنافہٕ تَنظیٖم یُس بیٚیَن اَدارَن میزبٲنی تہِ چھُ کَران: کامَنٕز آزاد میٖڈیا میٖڈیا وِکی وِکی سافتٕویر بَناونَس لَگان میٹاوِکی وِکیٖمیٖیڈیا مَنصوبَن نَظر تھَاوان وِکی کِتاب آزاد کِتاب وِکی ڈیٹا آزاد مولوٗماتھ وِکیٖلۄغتھ اَکھ آزاد لۄغَتھ وِکیٖپیٖڈیا زَبانہٕ یہِ وِکیٖپیٖڈیا چھُ کٲشرِس مَنٛز لؠکھنہٕ آمُت۔ باقؠن زَبانَن مَنٛز تہِ چھُ وِکیٖپیٖڈیا دٕستِیاب؛ کیٚنٛہہ بٔڈؠ وِکیٖپیٖڈیا چھِ بۄنہٕ کَنہِ: ۱۰،۰۰،۰۰۰ کھۄتہٕ زیادٕ مَضموٗن English العربية Deutsch Español Français Italiano Nederlands 日本語 Polski Português Русский Svenska Українська Tiếng Việt 中文 ۲،۵۰،۰۰۰ کھۄتہٕ زیادٕ مَضموٗن Bahasa Indonesia Bahasa Melayu 閩南語 / Bân-lâm-gí Български Català Čeština Dansk Esperanto Euskara فارسی‎ עברית 한국어 Magyar Norsk Bokmål Română Srpski Srpskohrvatski Suomi Türkçe ۵۰،۰۰۰ کھۄتہٕ زیادٕ مَضموٗن Asturianu Bosanski Eesti Ελληνικά Simple English Galego Hrvatski Latviešu Lietuvių മലയാളം Македонски Norsk nynorsk Shqip Slovenčina Slovenščina ไทย سَمٲجی رٲبطہٕ سَمٲجی رٲبطہٕ کین ویب سایٹَن پؠٹھ گٔژھِو شٲمِل: https://ks.wikipedia.org/w/index.php?title\u003dاَہَم_صَفہٕ\u0026oldid\u003d103752 پؠٹھٕ اِستِمال کۄٚرمُت 3 زَبانہٕ English Français اردو تَلاش ژھانٛڈُن اَہَم صَفہٕ 3 زَبانہٕ نٔو موضوٗع",
