    "content": "跳至內容 出自維基百科 WIKIPEDIA 維基百科 人人都寫得正嗰百科全書 贛語版本嗰維基百科 而今攏共有6,815篇文章 頁面分類 沙盤練習 廳下交流 全靚文章 南昌貢院係江西古時間舉行科舉鄉試嗰考場所在。到1905年科舉制度拕廢吥以前，全贛嗰秀才會三年一到嗰來南昌貢院參加比試，考中及第嗰就係「舉人」，頭名舉人稱「解元」。 江西人歷來作興讀書，盛行業儒之風，因為江西自身地狹人稠，科舉就有提供嘚一般人登科出仕嗰社會功用。《西園雜記》裡頭話南昌府「市井多儒雅之風」，吉安府「環吉水百里之疆多業儒」，廣信府「下逮田野小民生理裁足，皆知以課子孫讀書為事」，故係封建時代有「翰林多吉水，朝士半江西」嗰話法。 全靚文章 新出嗰事 二零二四年三月二十號，民航局通報“3·21”東航MU5735航空器飛行事故調查進展情況。 二零二二年十一月三十號，江澤民死嘚上海。 二零二二年三月二十一號，東航5735號航班跌落。 二零二二年二月二十四號，俄羅斯入侵烏克蘭。 別嗰新聞... 汝曉得啵？ 有哪些地方係話贛語嗰？ 客家話同吾等贛語原來還有該種關係？ 贛語也出現在書面文章？ 廬山嗰東林寺係什哩人做起嗰？（相） 早以江西最高級別嗰科舉考試係什哩？ 什哩職務嗰衙署係「承宣布政使司」？ 曷個文身嗰器官係世界頭上最大嗰？ 江西銀錢總號末後拕改做什哩銀行？ 法國政府早已搦曷隻詞去貶低地方語言？ 汝曉得啵 許年今日 12月9號： 前幾日：12月8號 – 12月7號 – 12月6號 別嗰許年今日 箇日靚畫 《江西省輿圖》係一本江西到清朝時間嗰地圖集。佢係到1732年－1743年之間拕繪製完成嗰。每頁40公分莽，54.5公分闊。繪製手法係絹本彩繪。 《江西省輿圖》採用嗰地理標示方向不同於而今嗰製圖慣例，佢係『南上北下』。𠵹也表現出江西嗰地理走勢——『南高北低』，贛江嗰水由贛南一徑流進贛北嗰鄱陽湖。 箇日靚畫 | 隨便望吖 維基辭典 分類：字音 · 部首 · 筆畫 · 詞類 · 語言 歡迎！ 維基百科係隻自由嗰、多語言版本嗰百科全書。到箇首，什哩人都貢獻得正佢嗰知識。我俚嗰目標係做起一隻完整、準確同得中立嗰百科全書。 隻隻人嗰貢獻都係揸得 Creative Commons 署名－相同方式共享（by‐SA）協議嗰條款內容發表嗰，遵守箇隻協議條款嗰任何人都自由嗰使用得正箇滴內容。 參與 汝贛語會話係啵？來勢！𠵹哩，汝曉得世界頭上有5000萬人都係話贛語嗰啵？佢排嘚世界頭多人話嗰語言裡頭嗰前40名。 贛語有自家嗰文字，係寫得正嗰。箇下維基百科就係隻特試供我個俚寫母語嗰好場化。搦我人嗰話，寫我人嗰事，話早已、話而今、話將來，話嘚全世界人聽！ 沙盤 | 本字 姊妹計劃 Wikipedia 係非營利嗰維基媒體基金會運作嗰。維基媒體基金會同時間有別嗰滴子多語言、開放內容嗰維基計劃： 元維基 協調各隻維基計劃 維基辭典 字典同到同義詞辭典 維基新聞 自由嗰新聞資源 維基教科書 教科書同說明書 維基語錄 名人名言嗰集全 維基文库 自由嗰圖書館 維基物種 自由嗰物種資料庫 維基學堂 自由嗰學習材料同活動 維基共享資源 共享嗰多媒體資料庫 若係汝覺得受 Wikipedia 嗰惠蠻多，請幫得Wiki基金會添購滴子設備。要聯繫我俚，請去新聞組或寄隻郵件。 If you do not speak or write Gan language but need to contact Gan Wikipedia, please leave us a message here. 版本頁「https://gan.wikipedia.org/w/index.php?title\u003d封面\u0026oldid\u003d400047」 1隻分類： 含有英語的條目 17種語言 العربية 閩東語 / Mìng-dĕ̤ng-ngṳ̄ English Español Français 客家語 / Hak-kâ-ngî עברית Italiano 日本語 한국어 Русский Tiếng Việt 吴语 中文 文言 閩南語 / Bân-lâm-gí 粵語 尋 尋 封面 17種語言 添主題",
