    "title": "Vikipedija",
    "content": "Pereiti prie turinio Straipsnis iš Vikipedijos, laisvosios enciklopedijos. Sveiki atvykę į Vikipediją Laisvąją enciklopediją, kurią kurti gali kiekvienas. Lietuviškojoje Vikipedijoje: 224 430 straipsnių Vikipedijos vedlys Pagalba DUK Bendruomenės portalas Klausk Taisyklės ir susitarimai Paveikslėlių naudojimas Apie Vikipediją Vikipedija yra universali, daugiakalbė interneto enciklopedija, kaip bendruomeninis projektas, pagal viki technologiją ir pamatinius principus kuriama daugybės savanorių bei išlaikoma iš paaukotų lėšų. Vikipedijos tikslas – pateikti laisvą, nešališką ir patikrinamą turinį, kurį be jokių apribojimų gimtąja kalba galėtų skaityti visi žmonės. Rašyti, pildyti, tobulinti straipsnius taip pat gali visi, jei laikomasi bendrų, visiems dalyviams galiojančių taisyklių ir susitarimų. Vikipedija nuolat kuriama, taisoma, tobulinama bei redaguojama, tad nėra jokių garantijų, kad enciklopedijoje pateikiama informacija yra teisinga. Nauji dalyviai yra kviečiami apsilankyti pagalbos puslapiuose ir bendruomenės portale. Vikipedija vadinama „laisvąja enciklopedija“, nes visas jos turinys pateikiamas pagal GFDL ir CC-BY-SA licencijas, kurios leidžia enciklopedijos turinį naudoti, keisti ir platinti tiek nemokamai, tiek ir mokamai, jei laikomasi naudojimo sąlygų. Rinktinė iliustracija Pandžširo slėnis, Afganistanas Projekto puslapis • Keisti Savaitės straipsnis Pirmojo pasaulinio karo metais Respublikos gatvė vokiečių okupacinės valdžios vadinta Stoties gatve Respublikos gatvė – viena pagrindinių Panevėžio miesto centro gatvių. Prasideda sankryžoje su Klaipėdos gatve ir tęsiasi 1,27 km šiaurės–šiaurės vakarų kryptimi iki Respublikos gatvės tilto. Gatvės tęsinys už tilto – Stoties gatvė. Beveik visa gatvės trasa patenka į saugomo kultūros paveldo objekto – Panevėžio miesto istorinės dalies – teritoriją, čia stovi daug svarbių miestui pastatų, nemaža jų dalis įrašyta į Kultūros vertybių registrą. Veikia Panevėžio miesto dailės galerija, Panevėžio apskrities Gabrielės Petkevičaitės-Bitės viešoji biblioteka, seniausias lietuviškas knygynas Lietuvoje, šiuolaikinio meno muziejus „Stasys Museum”, Juozo Balčikonio gimnazija ir kitos įstaigos. Gatvės atkarpa nuo J. Urbšio gatvės iki tilto kursuoja maršrutiniai miesto autobusai. Gatvė atsirado be plano. XVIII a. inventoriuose dar neminima, XIX a. pr. vadinta Kepėjų gatve. Iš pradžių buvusi kreiva, vieni namai stovėję arčiau, kiti – toliau nuo gatvės. Vėliau gatvė sutvarkyta. 1872 m. pirmajame projektiniame Panevėžio plane vadinama Bajorų gatve. Tęsėsi iki Šeduvos (dabar Vasario 16-osios) gatvės, toliau buvo dirbami laukai. Daugiau... Pavyzdiniai straipsniai • Verta paskaityti • Keisti • Rinkti straipsnį gruodžio 15 d. įvykiai Lietuvoje 1989 − Lietuvos Komunistų partija paskelbė atsiskirianti nuo Tarybų Sąjungos Komunistų partijos. 1990 − įkurta Lietuvos žmogaus teisių gynimo asociacija. 1992 − pasirašyta Lietuvos ir Norvegijos bevizio režimo sutartis. Pasaulyje 1939 − Atlantoje įvyko legendinio filmo „Vėjo nublokšti“ premjera. 1939 − JAV pagaminta pirmoji nailono partija. 1964 − Kanada įteisino naująją nacionalinę vėliavą su raudonu klevo lapu baltame fone. 1994 − išleista naršyklė Netscape Navigator 1.0. 1995 − Europos Sąjungos lyderiai numatomą įvesti bendrą valiutą pakrikštijo euro vardu. Keisti Savaitės iniciatyva Jonas Paulius I (lot. Johannes Paulus I, tikrasis vardas Albino Luciani; 1912 m. spalio 17 d. – 1978 m. rugsėjo 28 d.) – 263-asis popiežius, katalikų bažnyčios vadovas. Išrinktas popiežiumi 1978 m. rugpjūčio 26 d. Mirė po 33 dienų, tokiu būdu papildydamas trumpiausiai valdžiusių popiežių sąrašą. Jonas Paulius I – tai pirmasis popiežius, gimęs XX amžiuje ir paskutinis, miręs XX amžiuje. Italijoje jis prisimenamas kaip „Il Papa del Sorriso“ (Dievo šypsena). Tuo tarpu žurnalas „Time“ bei kiti leidiniai dėl trumpo valdymo laikotarpio popiežių vadino „Rugsėjo popiežiumi“. Albino Luciani gimė 1912 m. spalio 17 d. Forno di Kanalėje, Beluno provincijoje, šiaurės Italijoje, daugiavaikėje neturtingoje šeimoje. Tėvas Giovanni Luciani (1872?–1952) buvo nepataisomu socialistu ir antiklerikalu, o motina Bortola Tancon (1879?–1948) buvo karštai tikinti katalikė. Būtent jo motina ir kunigas Filippo Carli turėjo daugiausia įtakos jaunojo Albino tikėjimui ir vėlesniam gyvenimui. Be būsimojo popiežiaus, šeimoje augo sūnūs Federico (1915–1916) ir Edoardo (1917–2008) bei sesuo Antonia (1920–2009). Kartu su jais gyveno dvi seserys iš tėvo pirmosios santuokos. Šios savaitės iniciatyva yra Popiežiai. Projekto puslapis • Keisti Naujienos Gruodžio 15 d. Čilės prezidento rinkimus laimėjo griežtai dešiniųjų pažiūrų kandidatas José Antonio Kast, antrajame ture įveikęs centro kairės koalicijos kandidatę komunistę Jeanette Jara.[1] Gruodžio 14 d. Australijoje, Sidnėjaus Bondajaus paplūdimyje, vykstant Chanukos renginiui, per šaudynes žuvo mažiausiai 10 žmonių.[2] Gruodžio 13 d. Baltarusija paleido 123 politinius kalinius.[3] Gruodžio 11 d. Po antikorupcinių protestų atsistatydino Bu",
