    "content": "Zum Inhalt springen Us der alemannische Wikipedia, der freie Dialäkt-Enzyklopedy Schwyzerdütsch Badisch Elsassisch Schwäbisch Vorarlbergisch Grüaß Gott, habedere und willkomme uf dr alemannische Wikipedia! D freie Enzyklopedi, wo alle mittua künnand. Artikel fianda Artikel nooch Kategorie: Alle Kategorie • Bruuchtum • Ernährung • Geografi • Gschicht • Gsellschaft • Kunscht • Literatur • Musig • Natur • Persona • Politik • Religion • Sport • Sproch • Technik • Vrkehr • Würtschaft • Wüsseschaft Themaportal: Regionale Artikel Alemanne Alemannisch Bade Bade-Württebärg Basel Elsass Friburg Liachtastua Schwiiz Schwoba Vorarlberg Geografi Gschicht Gsellschaft Kunscht Literatur Musik Natur Politik Religion Sport Sproch Technik Wüsseschaft Suschtigs: Artikelindex vo A bis Z • Bsunders glungne Artikel • Lässige Artikel • Artikel nooch Dialäkt • Audioufnahma vo Artikel • Ufnama vu Dialäktwörtr • A Fabel in verschidnä Dialäkt übersetza • Alemannische Ortsnäma • Alemannische Tiernäma • Alemannische Pflanzanäma D Alemannische Wikipedia D alemannische Wikipedia isch a Enzyklopedi i dr Dialekt vom alemannische Sprochroum, also vo der Dütschschwyz, vom Elsass, vo Liachtastua, vo Oberbade, vom Schwobaland und vo Voradlberg. Dia Enzyklopedi wachst durch d freiwillige Hilf vo allna, wo eappas in irer Mundard beiträga wänd. Yträg künnand vo allna Bsuechar gschriba und gändrat wörra. Alle siand härzlich yglade mitzmacha. Bringand öüar Wiassa i und healfand so mit, s Alemannische z pfleaga, ufzumwearta und z erhalta. Di erschta Schritt siand ganz uafach! Wer mir vo dr Alemanische Wikipedia siand und was mir wänd, fiandasch in üsrem Profil. D Inhalt vo dr Wikipedia dürfand frei kopiert und verbreitet wörra. Bis jetz git s bi dr alemannische Wikipedia 31.413 Artikel. Artikel vo dr Wocha: Neapel Neapel (italienisch: Napoli [ˈnaːpoli], neapolitanisch: Napule [ˈnaːpulə] odder au [ˈnaːpələ]; vo Griechisch nea polis „neui Schtadt“) isch noch Rom und Mailand die drittgröschti Schtadt vo Idalie und die gröschti Schtadt vo Süditalie. S isch d Hauptschtadt vo der Region Kampanie und der Provinz Neapel. D Schtadt sälber het öbbe 1 Million Iiwohner mit erä hoche Dunkelziffre vo Persone, wo nit amtlig regischtriert si, zsämme mit de Vorört het d Agglomeration über 4,4 Millione Iiwohner. Neapel litt am Vesuv im Golf vu Neapel. D\u0027Aafäng vu de Stadt lige an de Chüste, wu de erscht Stadtchärn entstande-n-isch. Dört sin di griechische Koloniie gläge, wu de Aafang vum Handel bedütet un dodemit zur Entwicklig vu de hüttige Stadt biidrage hänn. S Stadtgebiet isch vu Hügel brägt, wu di meiste devuu e Höchi zwüsche 150 un 452 Meter hänn un wu eigeni Stadtdeil un Quartier druff entstande sin, dezüe chömme no mehreri Insle, Halbinsle un Buchte. Geologisch gseh hät Neapel e kumpläxi Gschicht, di letschti Schicht bstoht vor allem us Gröll mit vulkanischem Ursprung. 10 km vo Neapel liit dr Vulkan Vesuv. (…dr ganz Artikel leasa) Früenere Artikel vo dr Wocha: Bernau im Schwarzwald La Juive Lechquällegebirg Burge vo Bellinzona Sägi Bözberg Salesiaaner vom Don Bosco Gottlieb Jakob Kuhn Häasch gwiasst ... d Hanna Sahlfeld-Singer ... ass d Hanna Sahlfeld-Singer anne 1971 zue de eerschte elf Frauen im Nazionaalroot gheert het? ... dass sich de Leerer Emilio Stainer starch für sys Walserdoorff Alagna (Im Land) und sys Alagnertüütsch (Laindertitzschu) ygsetzt hät? ... dass im Sanggallar Rintil de pfifoldər uf s štrɔɔssboərgərlı goot? ... dàss dr Marne-Sittakànààl a Tail vum Wàsser vu dr Moivre uffnìmmt? ... dass dr Schwiizer Seminarischt Maurice Bavaud am 9. Novämber 1938 versuächt het, dr Adolf Hitler z\u0027Münchä z\u0027erschiässä? Alemannische Nochrichta: 9. Dezämber 2025: \"Genau so bled wie wir\": Wie die Band Rhinwaldsounds aus Kappel-Grafenhausen unerwartet einen Hit landete (Badische Zeitung) «De chlii Prinz» spricht jetzt auch Schwyzer Dialekt (Der Bote) Wie Dialekt ein Weltbuch neu öffnet (journal21.ch) 4. Dezämber 2025: Hans Jürg Zingg: «und im ärnschtfall ischs luschtig» (SRF) 3. Dezämber 2025: «Summervogel»? «Schmetterling»! Wie Mundart-Wörter aussterben (20min) «‹Kartoffel› und ‹Karotte› gehören zu unserem Wortschatz» (20min) Mundart lebt in der Kita Kinderwelt auf (Südkurier) Mea Nochrichta uf Dialäkt-Nöüigkeita 10. Dezämber Dag vu dr Mänscherächt Alfred Nobel 1830: D Regierig vum Kanton Aargau akzäptiert d Forderige vu dr Ufständische vum Freiämtersturm. Mit dr Uusarbaitig vun ere neie Verfassig wird aagfange. 1848: No dr Februarrevolution wird dr Louis Napoléon Bonaparte, e Neffe vum Napoléon I., zum Staatsbresidänt vu Frankrych gwehlt. 1901: Am Dodesdag vum Alfred Nobel (Bild) wäre vu jetz ab alljohr d Nobelbryys vergee, dr Friidesnobelbryys z Oslo, di andere z Stockholm. 2003: Bi dr Wahle in dr Schwyz wird d SVP unter em Christoph Blocher in boode Chammere vum Barlemänt di sterkscht Bartei. Us däm Grund hebt si Aaschpruch uf e zweete Bundesrot. Des sprängt d „Zauberformle“, wu s syt 1959 bstoht. Neabeprojäkt: Wörterbuach (Wiktionary) Tekschtsammlung (Wikisour",
