    "id": 328,
    "url": "https://en.wikipedia.org/wiki/Clair_Obscur:_Expedition_33",
    "title": "Clair Obscur: Expedition 33 - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia 2025 video game \"Expedition 33\" redirects here. For the space expedition, see Expedition 33 (ISS). 2025 video game Clair Obscur: Expedition 33 Developer Sandfall Interactive Publisher Kepler Interactive Director Guillaume Broche Producer François Meurisse Designers Guillaume Broche Michel Nohra Programmer Tom Guillermin Artist Nicholas Maxson-Francombe Writers Jennifer Svedberg-Yen Guillaume Broche Victor Deleard Composers Lorien Testard Alice Duport-Percier[a] Engine Unreal Engine 5 Platforms PlayStation 5 Windows Xbox Series X/S Release 24 April 2025 Genre Role-playing Mode Single-player Clair Obscur: Expedition 33 [b] is a 2025 role-playing video game developed by French studio Sandfall Interactive and published by Kepler Interactive. Set in a dark fantasy Belle Époque setting, the game follows the volunteers of Expedition 33 as they set out to destroy the Paintress, a being causing the yearly Gommage, which erases those at or above an ever-decreasing age. In the game, the player controls a party of characters from a third-person perspective, exploring areas and engaging in combat. Its turn-based mechanics feature real-time aspects such as quick time events and timed actions in combat. The project originated in 2019 with Guillaume Broche, a Ubisoft employee, who left the following year during the COVID-19 pandemic to form Sandfall with friends and contacts, steadily establishing a core team of 30 developers that came to be supported by various production partners. Inspired by Japanese RPGs that shaped their youth such as the Final Fantasy and Persona series, the developers at Sandfall sought to create a high-fidelity turn-based role-playing game, which they felt was neglected by AAA studios. Development began with Unreal Engine 4 and later switched to Unreal Engine 5, providing rendering improvements. In January 2025, Story Kitchen announced a live-action adaptation of the game with developer Sandfall Interactive.[3] Clair Obscur: Expedition 33 was released for PlayStation 5, Windows and Xbox Series X/S on 24 April 2025, and was available from day one on Xbox Game Pass. The game received universal acclaim from critics for its narrative, art direction, game direction, original soundtrack, gameplay and voice acting. Clair Obscur: Expedition 33 was nominated for and won several awards. It became the most awarded title at The Game Awards 2025 over 9 nominations and in the event\u0027s history, including Game of the Year at both it and the Golden Joystick Awards, and appeared on several publications\u0027 lists of best games of 2025. By October 2025, it had sold over 5 million units. Gameplay [edit] In this screenshot, Lune, Gustave, and Maelle are fighting against an enemy. On each turn, players can perform a basic melee attack, consume an item, use action points to shoot an enemy or use a skill. Clair Obscur: Expedition 33 is a third-person turn-based role-playing game with real-time elements. The player controls a party of Expeditioners exploring a fantasy world. On their turns, players select whether to use an item, perform a melee attack to gain Ability Points, or spend accumulated Ability Points to use ranged attacks or Skills.[4] Ranged attacks are aimed freely, similar to a third-person shooter. When using a Skill, a quick time event can be completed for improved effects.[5] During enemy turns, the player can dodge, parry, or jump over attacks in real time to avoid damage.[6] Parrying requires more precise timing than dodging but provides Ability Points and the opportunity to counterattack.[7] A stamina system allows players to \"Break\" enemies, temporarily stunning them.[8] As players progress, the game introduces new attacks and parries, including Gradient Attacks, Gradient Counters, and Gradient Skills, all of which deal significant damage. The use of gradient attacks is monitored by the party using a shared gauge. It will slowly fill up when the party uses skills in combat.[9] The Expeditioners and enemies can also apply various status effects on each other, boosting or impairing either side\u0027s combat efficiency. Some enemies have weak points that can be targeted, or may be vulnerable to certain elemental attacks.[10] If the combat party is defeated, reserve characters may be called in to continue fighting. Combat ends when either side has no remaining combatants,[7] or when the player decides to flee the battlefield when they are facing minor enemies.[11] The game features six playable characters, with each having unique skill trees, weapons and gameplay mechanics. The mage Lune\u0027s Skills generate elemental \"Stains\", which can be spent to enhance her Skills. The fencer Maelle switches between Stances which alter her Skills, damage and defense. The scythe-wielding warrior Sciel can use a set of magical cards to apply and stack \"Foretell\" to enemies, and then consume them to inflict maximum damage on enemies. Gustave and Verso deal more damage to enemies the",
