    "url": "https://af.wikipedia.org/wiki/Tuisblad",
    "title": "Wikipedia",
    "content": "Gaan na inhoud in Wikipedia, die vrye ensiklopedie Welkom by Wikipedia, die vrye ensiklopedie wat deur enigiemand verbeter en uitgebrei kan word. Maandag, 15 Desember 2025 Hier is tans 127 490 artikels in Afrikaans. Help ons om ’n wêreldklas-ensiklopedie in Afrikaans te skep. Inleiding • Hulp • Kontak Gebruikersportaal • Voorbladartikels • Kategorieë • Stel ’n vraag Voorbladartikel Antinoös of Antinoüs (Grieks: Ἀντίνοος; omstreeks 111 – omstreeks 130) was \u0027n Griekse adolessent uit Bithynia en \u0027n gunsteling en minnaar van die Romeinse keiser Hadrianus. Na sy voortydige dood is Antinoös op Hadrianus se aandrang vergoddelik en aanbid in beide die Griekse Ooste en Latynse Weste; somtyds selfs as \u0027n god (Grieks: θεός, transliterasie: theós) en soms as \u0027n Griekse held (Grieks: ἥρως, transliterasie: hḗrōs). Daar is min bekend oor Antinoös se lewe, alhoewel dit bekend is dat hy gebore is in Claudiopolis (hedendaagse Bolu, Turkye), in die Romeinse provinsie Bithynia. Hy is waarskynlik in 123 bekend gestel aan Hadrianus, voordat hy geneem is na Italia vir sy hoër opvoeding. Teen 128 was hy Hadrianus se gunsteling, en hy is geneem op \u0027n toer deur die Romeinse Ryk as deel van Hadrianus se persoonlike gevolg. Antinoös het Hadrianus vergesel tydens sy bywoning van die jaarlikse Eleusiniese misterieë in Athene. Hy was ook saam met Hadrianus toe hy die Maroesiese leeu in Libië gedood het. Antinoös het in Oktober 130 te midde van geheimsinnige omstandighede gesterf, toe hy en Hadrianus deel was van \u0027n flottielje wat langs die Nyl gevaar het. Verskeie voorstelle is gemaak vir die oorsaak van sy dood, wat wissel van \u0027n toevallige verdrinking tot \u0027n opsetlike menslike opoffering of selfs selfmoord. Na sy dood het Hadrianus Antinoös as \u0027n god verklaar en \u0027n georganiseerde kultus gevestig wat toegewy was aan sy aanbidding en regdeur die Ryk versprei het. Hadrianus het die stad Antinoöpolis naby Antinoös se sterfplek gestig, wat \u0027n kultussentrum geword het vir die aanbidding van Osiris-Antinoös. Hadrianus het ook \u0027n spele gestig ter herdenking van Antinoös wat in beide Antinoöpolis en Athene plaasgevind het. Antinoös het \u0027n simbool geword van Hadrianus se drome van pan-Hellenisme. Die aanbidding van Antinoös het een van die mees blywende en gewildste kultusse van vergoddelikte mense in die Romeinse Ryk geword, en verskeie gebeurtenisse is nog lank na Hadrianus se afsterwe in sy naam gevestig. Antinoös het gevolglik \u0027n simbool van manlike homoseksualiteit in die Westerse kultuur geword en het verskyn in die werk van Oscar Wilde, Fernando Pessoa en Marguerite Yourcenar. ...lees verder In die nuus Lando Norris in 2025 Tydens die 2025 Formule Een-seisoen wen Lando Norris sy eerste Formule Een-wêreldbestuurderskampioenskapstitel, terwyl sy McLaren-span reeds in Oktober by die Singapoerse Grand Prix as die wêreldvervaardigerskampioen vir 2025 gekroon is. Binne enkele dae is die groepsloting vir drie vername, toekomstige sporttoernooie gehou: die T20I-wêreldbeker 2026 in Indië en Sri Lanka, die FIFA Sokker-Wêreldbekertoernooi in 2026 in Kanada, Meksiko en Amerika, asook die Rugbywêreldbeker 2027 wat in Australië sal plaasvind. Ná die afsluiting van die 30ste G20-spitsberaad in Johannesburg het Suid-Afrika sy G20-voorsitterskap aan die Verenigde State oorhandig. Die voormalige Bangladesjiese eerste minister Sjeikh Hasina, wie haar in ballingskap in Indië bevind, is weens haar onderdrukking van die 2024-proteste in afwesigheid skuldig bevind aan misdade teen die mensdom en die doodstraf opgelê. In die eindstryd van die 13de Vrouekrieketwêreldbekertoernooi op die DY Patil-stadion in Navi Mumbai verslaan die medegasheer Indië Suid-Afrika met 52 lopies en palm sodoende sy eerste vrouekrieketwêreldbekertitel in. Die verdedigende kampioen Australië en Engeland was die ander twee semi-finaliste. Voortdurend: Russiese inval in Oekraïne sedert 2022 • Israel-Hamas-oorlog • Soedanese burgeroorlog Onlangs oorlede: Tom Stoppard • Evelyn Dalberg • Pops Mohamed • Frank Gehry • Rob Reiner Het u geweet... ... dat die katedraal van Straatsburg, met sy toring van 142 meter, wat in 1439 in Straatsburg voltooi is, sover bekend tot 1874 die hoogste gebou ter wêreld was? ... dat daar absoluut niks tussen 3 en 13 September 1752 gebeur het nie? In hierdie maand is die Juliaanse kalender in Brittanje en sy Amerikaanse kolonies met die Gregoriaanse kalender vervang. Die nuwe kalender was 11 dae voor die ou een; dus het 14 September direk op 2 September gevolg. ... dat die wêreld se oudste restaurant in Salzburg in Oostenryk is? Die Stiftskeller St. Peter was oorspronklik \u0027n klooster wat reeds in 803 n.C. begin het om reisigers van maaltye te voorsien. ... dat die Mercury-Redstone 1 ruimtevlug as die vierduim vlug bekend staan? ... dat Botswana die mins korrupte land in Afrika is? Volgens Transparency International is dit naby lande soos Portugal en Suid-Korea gelys. Vandag in die geskiedenis 15 Desember: Oscar Niemeyer 1815 – Die Slagtersnek-rebelle word in die Ui",
