    "id": 326,
    "url": "https://fi.wikipedia.org/wiki/Wikipedia:Etusivu",
    "title": "Wikipedia, vapaa tietosanakirja",
    "content": "Siirry sisältöön Wikipediasta Tervetuloa Wikipediaan, vapaaseen tietosanakirjaan. Suomenkielisessä Wikipediassa on tällä hetkellä 609 285 artikkelia. Haku • Ajankohtaista • Selaa luokittain • Luo artikkeli Suositellut • Hyvät • Lupaavat artikkelit • Uudet sivut Tervetuloa Wikipediaan ja tietoja Wikipediasta UKK • Artikkelin luominen • Keskustelu • Neuvonta Suositeltu artikkeli Piikkiön rautatieasema (lyh. Pik, ruots. Pikis järnvägsstation) on rantaradalla Kaarinan kaupungin Piikkiön taajamassa sijaitseva rautatieliikennepaikka. Siihen aikaisemmin kuuluneen vuonna 1898 rakennetun asemarakennuksen on suunnitellut Bruno Granholm. Asema sijaitsee 10 kilometrin päässä Paimion rautatieasemalta ja 13 kilometrin päässä Kupittaan rautatieasemalta. Piikkiön rautatieasema avattiin yleiselle liikenteelle 1. marraskuuta 1899. Aseman toiminta kesti henkilöliikenteessä yli 80 vuotta, kunnes 25. toukokuuta 1979 henkilöliikenne asemalla lakkautettiin. Ratapihan kauko-ohjauksen valmistuttua vuonna 1995 asema muutettiin kokonaan miehittämättömäksi. Piikkiön rautatieasema on enää tavaraliikenteen käytössä (jonkin verran puunkuormausta) sekä junakohtauspaikkana. Rautatieliikenteen ohjaus hoidetaan keskitetysti Helsingin kautta. Säännöllistä henkilöliikennettä asemalla ei enää ole. Joulukuusta 2016 lähtien asemarakennus on ollut yksityisomistuksessa. Katso lisää aiheeseen liittyviä laadukkaita artikkeleita: Hietamäen rautatieasema ja Nousiaisten rautatieasema. Lisää suositeltuja, hyviä ja lupaavia artikkeleita Miten voit auttaa Wikipedia tarvitsee apuasi! Punainen linkki tarkoittaa, että aiheesta ei vielä ole artikkelia. Voit auttaa kirjoittamalla puuttuvista aiheista. Suuri synagoga (Sydney) · Vaasan kirjamessut(?) · Neuvostovallan aika Baltian maissa · Max Söderman(?) · Mark Bernstein(?) · passiivimatriisinäyttö · lohikäärmetanssi (tanssi) · Aarne–Thompson-luokitus(?) · Tanya Tucker · Tähystäjätontun seikkailut(?) · suuri valhe(?) · Atlantan murhat 1979–1981 · kaukalojalkapallo · viinintuotanto Etelä-Afrikassa · Candyman (elokuvasarja) · reaalianalyysi Viikon kilpailun aiheena on tällä viikolla Yhdysvallat ja Kanada. Lisää artikkelitoiveita · Osallistu Wikiprojekteihin · Paranna sivuja Osallistu artikkeleiden vertaisarviointiin · Laajenna tynkiä Äskettäin kuolleita Rob Reiner (1947–2025) oli yhdysvaltalainen näyttelijä, ohjaaja, tuottaja ja käsikirjoittaja. Reiner ja hänen vaimonsa Michele Singer löydettiin kotoaan kuolleina henkirikoksen uhreina. Katso myös: Robert Rousseau Christopher Wegelius Terence Higgins Natalja Petrusjova Peter Greene Shivraj Patil Jim Ward Lisää äskettäin kuolleita Uutisissa Lando Norris vuonna 2024. Sydneyssä ainakin 16 kuoli hanukka-juhlaa viettämässä olleisiin juutalaisiin kohdistuneessa terrori-iskussa. (14.12.) Brittiläinen kilpa-autoilija Lando Norris voitti Formula 1 -kauden 2025 mestaruuden. (7.12.) Guinea-Bissaussa armeija kaappasi vallan kolme päivää presidentin- ja parlamenttivaalien jälkeen. (26.11.) Ainakin 156 ihmistä kuoli Hongkongissa syttyneessä tulipalossa, joka levisi seitsemään asuinkäytössä olevaan tornitaloon. (26.11.) Belémin ilmastokokous päättyi. Päätöslauselmaan ei saatu sitovaa suunnitelmaa fossiilisista polttoaineista luopumiseksi. (22.11.) Meneillään: Gazan sota • Venäjän hyökkäys Ukrainaan Vuosi 2025 – Wikiuutiset – Lisää uutisia 15. joulukuuta Henri Becquerel 1852 – Ranskalainen fyysikko Henri Becquerel syntyi. 1855 – Kuvanveistäjä Ville Vallgren syntyi. 1861 – Suomen tasavallan presidentti Pehr Evind Svinhufvud syntyi. 1970 – Neuvostoliiton avaruusluotain Venera 7 laskeutui onnistuneesti Venuksen pinnalle ja oli näin ensimmäisenä laitteena toimintakuntoisena toisella planeetalla. 1991 – Suomenlinna ja Vanha Rauma hyväksyttiin ensimmäisinä suomalaiskohteina Unescon maailmanperintöluetteloon. 2013 – Etelä-Sudanin sisällissota alkoi. Lisää tapahtumia sekä vuosipäiviä Tiesitkö, että... Mr. Lordi …Mr. Lordi toimi Viron euroviisuedustajan valitsevan Eesti Laul -kilpailun tuomarina vuonna 2022? …kansallissosialismin uhrit ja heidän jälkeläisensä voivat hakea Saksan tai Itävallan kansalaisuutensa palautusta, mikäli natsit poistivat sen heiltä? …vuonna 1971 mustajalkoja edustanut päällikkö Earl Old Person rikkoi vahingossa tuhatvuotista perinnettä pyytäessään Iranin šaahia nousemaan seisomaan vierellään samalla kun Old Person piti puhetta? …Naton 5. artiklaa on käytetty toistaiseksi ainoan kerran syyskuun 11. päivän terrori-iskujen jälkeen? Lisää nippelitietoa Wikipedian sisarhankkeet Wikipediaa ylläpitää voittoa tavoittelematon Wikimedia Foundation, joka ylläpitää muitakin monikielisiä vapaan sisällön hankkeita: Commons Yhteisiä mediatiedostoja Hautomo Uusien hankkeiden hautomo MediaWiki Wiki-ohjelmiston kehitys Meta-Wiki Wikimedian hankkeiden koordinaatio Wikiaineisto Vapaiden tekstien arkisto Wikidata Vapaa tietopankki Wikikirjasto Vapaita oppikirjoja ja oppaita Wikimatkat Matkaopas Wikiopisto Vapaa oppimisen verkkoyhteisö Wikisanakirja Sanakirjoja Wikisitaatit Sitaattikokoel",
