    "url": "https://es.wikipedia.org/wiki/Wikipedia:Portada",
    "title": "Wikipedia, la enciclopedia libre",
    "content": "Ir al contenido De Wikipedia, la enciclopedia libre Bienvenidos a Wikipedia, la enciclopedia de contenido libre que todos pueden editar. Buscar en 2 080 490 artículos 2 080 490 artículos en español. Café ¿Cómo colaborar? Primeros pasos Ayuda Contacto Artículo destacado Coldplay Actuación en el Estadio de Wembley en 2025. Coldplay es una banda británica de rock formada en Londres en 1997. Está compuesta por el vocalista y pianista Chris Martin, el guitarrista Jonny Buckland, el bajista Guy Berryman y el baterista Will Champion, además de Phil Harvey como su mánager. Sus integrantes se conocieron en el University College de Londres. Firmaron con Parlophone en 1999 y lanzaron su primer álbum, Parachutes (2000), que incluyó el sencillo «Yellow», con el que alcanzaron la fama. Su siguiente trabajo, A Rush of Blood to the Head (2002), logró también una gran acogida. X\u0026Y (2005) cerró lo que la banda consideraba una trilogía, y su sucesor, Viva la Vida or Death and All His Friends (2008), ganó el Grammy al mejor álbum de rock. Además, «Viva la vida» fue la primera canción de un grupo británico en alcanzar de manera simultánea el número uno en Estados Unidos y el Reino Unido en el siglo XXI. Coldplay amplió su repertorio con los discos Mylo Xyloto (2011), Ghost Stories (2014), A Head Full of Dreams (2015), Everyday Life (2019), Music of the Spheres (2021) y Moon Music (2024), en los que incorporaron influencias de la música electrónica, el R\u0026B, el ambient, la música disco, el funk, el góspel, el blues y el rock progresivo. Con más de 160 millones de álbumes vendidos en todo el mundo, Coldplay figura entre los artistas más exitosos de la historia. Fue la primera banda en alcanzar 90 millones de oyentes mensuales en Spotify y la cadena Fuse los incluyó entre los músicos más premiados, al mantener el récord de mayor número de premios Brit obtenidos por un grupo. En el Reino Unido, cuenta con tres de los cincuenta álbumes más vendidos, la mayor cantidad de discos que alcanzaron el primer puesto en la lista UK Albums Chart sin descender de las diez primeras posiciones y el reconocimiento como el conjunto más reproducido del siglo XXI en los medios británicos. Dos de sus actuaciones en directo figuran entre las más taquilleras y concurridas de todos los tiempos. La Industria Fonográfica Británica los describió como una de las bandas «más influyentes y pioneras» del mundo, mientras que el Salón de la Fama del Rock and Roll incluyó A Rush of Blood to the Head en su lista de los 200 discos definitivos y a «Yellow» en la exhibición Songs That Shaped Rock and Roll. Además de su carrera musical, el grupo ha destacado por su labor filantrópica, política y activista. Sin embargo, pese a sus indiscutibles éxitos, ciertos sectores de la crítica han puesto en entredicho su legado como icono cultural. Leer Todos los artículos destacados Candidatos Anteriores: Batalla de Santa Mónica Fibrosis quística Fortificaciones de Pamplona Artículo bueno Sarcoscypha coccinea Sarcoscypha coccinea Sarcoscypha coccinea, comúnmente conocida como copica escarlata, es una especie de hongo de la familia Sarcoscyphaceae, del orden Pezizales. El hongo puede encontrarse en todos los continentes excepto en la Antártida. Es la especie tipo del género Sarcoscypha, la cual ha sido conocida con muchos nombres desde su primera aparición en la literatura científica en 1772. El análisis filogenético indica que la especie estaría muy relacionada con otras de Sarcoscypha que contienen numerosas gotitas de aceite en sus esporas, como la especie S. macaronesica, de las islas del Atlántico Norte. Leer Todos los artículos buenos Candidatos Anteriores: Lynyrd Skynyrd Deep Purple in Rock Sitta carolinensis Recurso del día Hongo oronja Hongo oronja El oronja (Amanita caesarea) comúnmente conocida como el hongo de César, es un hongo comestible muy apreciado del género Amanita, originario del sur de Europa y el norte de África. Su cuerpo fructífero se desarrolla entre el verano y otoño, aunque crece mayormente en lugares con tormentas abundantes. Suele localizarse en regiones de clima mediterráneo en Europa. Muestra preferencia por los terrenos silíceos y bosques aclarados, encontrándose principalmente bajo alcornoques, encinas, robles, castaños y, ocasionalmente, coníferas. Archivo Actualidad Guerras y conflictos: Generación Z (varios países), Estados Unidos-Venezuela, Gaza-Israel, Rusia-Ucrania 14 de diciembre: Tiroteo en Bondi Beach 14 de diciembre: Segunda vuelta de las elecciones presidenciales de Chile 14 de diciembre: Máximo de las Gemínidas 12-21 de diciembre: Vuelta a Costa Rica 10-17 de diciembre: Copa Intercontinental de la FIFA 9-14 de diciembre: Campeonato Mundial de Clubes de Voleibol Femenino 26 de noviembre-14 de diciembre: Campeonato Mundial de Balonmano Femenino Fallecimientos 14 de diciembre: Kshamenk, orca argentina (32-34) 14 de diciembre: Eva Giberti, psicóloga y psicoanalista argentina (96) 13 de diciembre: Bruno Baveni, futbolista y entrenador italia",
