    "content": "跳至內容 Wikipedia (chū-iû ê pek-kho-choân-su) beh kā lí kóng... Kóaⁿ-kín lâi-khì Wikimedia Incubator pang-bâng siá Bân-lâm-gú pán-pún ê Wikinews. Hoan-gêng kong-lîm Wikipedia Chū-iû ê pek-kho-choân-su Chit-má ū 433,855 phiⁿ Bân-lâm-gú ê bûn-chiuⁿ Bo̍k-lio̍k Chú-tê Chhiū-á-kha FAQ Guestbook Hoan-gêng Liân-lo̍k Pian-chi̍p Sin bûn-chiuⁿ Hàn-jī choán-siá chiò-iáⁿ Gē-su̍t Ki-su̍t Kho-ha̍k Le̍k-sú Siā-hōe Sò͘-ha̍k Tē-lí Tiat-ha̍k Toān-kì Súi-khùi ê bûn-chiuⁿ Sin-bûn kì-sū Taⁿ--ê Tiong-hoâ Bîn-kok Kok-koa sī Sun Tiong-san kah in bō͘-liâu chok-sû, Thiâⁿ Bō͘-ûn (程懋筠) chok-khek. Pa̍t-miâ Sam-bîn Chú-gī Koa, mā-sī Tiong-kok Kok-bîn-tóng--ê tóng-koa. Tī 1937 nî chèng-sek kéng kok-koa í-chêng, hőng khoàⁿ-choè Tiong-hôa Bîn-kok kok-koa--ê ū Kheng-hûn-koa (卿雲歌), Tiong-hôa Hiông-li̍p Ú-tiū Kan (中華雄立宇宙間) téng koa-khek. (Tha̍k choân-phiⁿ...) Chûn-tóng · Thê-miâ 2025 nî 11 goe̍h 26 ji̍t, Hiong-káng Tōa-po͘ Hông-hok-oán hóe-sio-chhù (宏福苑-, siòng-phìⁿ) , chō-sêng siōng-chió 36 ê lâng kòe-sin. 2025 nî 10 goe̍h 22 ji̍t, Tâi-oân Tâi-tiong-chhī thoân-chhut Hui-chiu ti-che ê chai-chêng. 2025 nî 10 goe̍h 4 ji̍t, Ji̍t-pún Chiòng-gī-īⁿ gī-goân Takaiti Sanae(高市早苗) tòng-soàn Chū-iû Bîn-chú-tóng tóng-khoe (黨魁), chiâⁿ ū khó-lêng chiâⁿ-chò Ji̍t-pún thâu chi̍t ūi lú-sèng siú-siōng. 2025 nî 9 goe̍h 23 ji̍t, Tâi-oân Hoa-liân-koān Bān-êng-hiong Fata\u0027an-khe (馬太鞍溪) pang-soaⁿ-ô͘ ê ô͘-chúi ek-chhut, tì-kàu soaⁿ-kha ê Kong-ho̍k-hiong téng-tē chò-tōa-chúi, kàu 9 goe̍h 28 ji̍t thóng-kè ū 17 ūi kòe-sin. 2025 nî 8 goe̍h 15 ji̍t, Bí-kok Chóng-thóng Donald Trump kap Lō͘-se-a Chóng-thóng Vladimir Putin tī Bí-kok Alaska-chiu kí-hêng ko-chân hōe-gī. 2025 nî 7 goe̍h 26 ji̍t, Tâi-oân khí-pān kā Li̍p-hoat-īⁿ lâi-té ê 24 ūi Tē 11 kài ê Tiong-kok Kok-bîn-tóng khu-he̍k li̍p-hoat úi-goân kap Sin-tek-chhī Chhī-tiúⁿ pā-bián ê thâu-phiò (sio̍k tī Tōa-pā-bián ê chêng-tōng), kiat-kó lóng bô poàⁿ ê pā-bián thong-kòe. Kî-thaⁿ ê sin-bûn Lí kám chai-iáⁿ... Tong-nî ê 12 goe̍h 9 ji̍t Phû-tô-gâ Borgonha Ông-tiâu sī Afonso Henriques kā in lāu-bú León ê Teresa táⁿ-pāi liāu-āu khai-ki--ê? Tó chi̍t ūi Bí-kok thoân-kàu-sū chhut-pán liáu tē-it phō iōng Eng-gú choān-siá ê Pe̍h-ōe-jī kàu-kho-su? (siōng) Tó chi̍t ê liân-hō sī Tiong-kok Bêng-tiâu chòe-āu chi̍t ūi hông-tè Ui-chong chāi-ūi sî-kî ê liân-hō? Tó chi̍t-ê siâⁿ-chhī sī Hô-lân Groningen Séng ê séng-hōe? Tó chi̍t ūi Eng-kok cha-bó͘ koa-chhiú tī 12 hòe ê sî-chūn chiū iâⁿ-tio̍h Open Mic UK ê pí-sài koan-kun? Tó chi̍t tiâu hô-chhoan ū choân Pak Bí-chiu siāng tōa ê chúi-hē hoān-ûi? Liân-ha̍p-kok chū 1946 nî khai-sí sú-iōng tó chi̍t ki kî-á chò-ûi tāi-hōe hōe-kî? Chûn-tóng Kî-thaⁿ sin bûn-chiuⁿ 12 goe̍h 9 ji̍t: 1758 nî: Chhit-nî Chiàn-cheng: Tāi-eng Tang Ìn-tō͘ Kong-si kap Hoat-lân-se Tang Ìn-tō͘ Kong-si chi kan hoat-seng Condore Chiàn-tò͘. 1775 nî: Bí-kok Kek-bēng Chiàn-cheng: Virginia chham North Carolina kap Eng-kok hoat-seng Great Bridge Chiàn-tò͘. 1961 nî: Tanganyika chū Eng-kok to̍k-li̍p. 1968 nî: Bí-kok hoat-bêng-ka Douglas Engelbart thâu-pái tián-sī ku̍t-chhí (tô͘), hypertext, graphical user interface (GUI) téng-téng siat-kè. Tong-nî ê 12 goe̍h 8 ji̍t 12 goe̍h 9 ji̍t 12 goe̍h 10 ji̍t Te̍k-sek siá-chin Se̍k-sāi Wikipedia kap Holopedia Canada Rocky Soaⁿ-me̍h--ê John Laurie Soaⁿ Hip-siòng: Chuck Szmurlo Commons téng ê ko-phín-chit siòng-phìⁿ Wikipedia sī 1-ê chū-iû lōe-iông ê bāng-lō· pek-kho-choân-su. I ê bo̍k-tek sī beh kiàn-li̍p 1 thò \"chū-iû\", bián-chîⁿ, to-gí ê pek-kho-choân-su. Wikipedia sī bāng-lō· téng siāng chē lâng sú-iōng ê 1-ê chham-khó sèng-chit ê bāng-chām; i ê chu-goân pêng-kin 1 ji̍t hông lia̍h 5-chheng-bān pái [1]. Tû-liáu thoân-thóng ê pek-kho-choân-su sû-tiâu í-gōa, iū-koh ū pau-koah tio̍h chú-iàu ê sin-bûn sū-kiāⁿ, lông-bîn-le̍k téng-téng ê lōe-iông. Wikimedia Ki-kim-hōe chit-ê bô-tì-ì-beh-thàn-chîⁿ ê tan-ūi tī āu-piah chi-oān it-poaⁿ-sèng ê koán-lí kap chhau-chok. Lōe-iông hong-bīn oân-choân khai-hòng hō· chèng-lâng ha̍p-chok hoat-tián. Lōe-iông tōa-pō·-hūn sī sè-kài chē-chē kok ê jîn-sū tàu-tīn chhiâu--chhut-lâi ê kiat-kó. Chham-ka ê lâng chū-goān bô tēng-sî khai ka-kī ê sî-kan siá-chok, chè-tô·, siu-kái, chéng-lí, thó-lūn, soan-thoân chit-ê sū-kang. Chí-mōe kang-sū Wikipedia ê chûn-chāi sī in-ūi ū Wikimedia Ki-kim-hōe, chi̍t ê teh koán-lí kok-chióng giân-gí kap bián-hùi lōe-iông hāng-bo̍k ê hui-êng-lī cho͘-chit: Commons Chū-iû ê mûi-thé chu-liāu-khò͘ Wiktionary Chū-iû ê jī-tián kap sû-tián Wikisource Chū-iû lōe-iông ê tô͘-su-koán Wikispecies Bu̍t-chéng ê bo̍k-lio̍k MediaWiki Wiki ê nńg-thé khai-hoat Meta-Wiki Wiki kang-sū ê hia̍p-tiau Wikidata Chū-iû ê tì-sek-khò͘ Wikibooks Chū-iû ê kàu-kho-su Wikinews Chū-iû lōe-iông ê sin-bûn Wikiquote Bêng-jîn ê miâ-giân Wikiversity Chū-iû ê ha̍k-si̍p châi-liāu kap oa̍h-tāng Wikivoyage Chū-iû ê lí-hêng chí-lâm Kî-thaⁿ pán-pún Chit-ê pán-pún ê Wikipedia sī ēng Bân-lâm-gú Pe̍h-ōe-jī siá--ê, chū 2004 nî khai-sí, kàu-taⁿ í-keng ū 433,855 phiⁿ bûn-chiuⁿ. Tû-liáu Bân-lâm-hē giân-gú, Wikipedia iáu-koh ū kî-thaⁿ pán-pún--ê; ē-kha ū kúi-nā chióng pán-pún ê liân-kiat. Chhiau-kòe 1,00",
