    "url": "https://lmo.wikipedia.org/wiki/Pagina_principala",
    "title": "Wikipedia",
    "content": "Và al contegnud De Wikipedia Benrivad in su la Wikipedia in lengua lombarda L\u0027enciclopedia libera qe tuts i pœl dar una man a scriver con 79 902 vox Acess segur Version standard Varda l\u0027index Varda la Guida essenziala Pajina principala in Nœva Ortografia Lombarda Dervir un cunt Wikisource in Lombard Wikizionari in Lombard Vox ind la vedrina El Pertusaa El Franzesch Pertusaa (Francesco Pertusati in italian; Milan, 9 de masg 1741 - Milan, 22 de masg 1823) a l\u0027è stad un scritor, poeta e nobel lombard. Sciambellan de l\u0027Imperador e magistrad di LX Decurion, l\u0027è regordad soratut per i so traduzzion de liber e palper a tema religion e storia e per la soa poesia in dialet milanes, tant de vesser considerad vun di poeta pussee boni del so temp a Milan. Fioeul del Luca, Cont Questor e poeu Senator de Milan, e de la Mariana Pravesina, el so barba a l\u0027era el Franzesch Pertusaa, vescov de Pavia, che l\u0027ha tegnud a batesim in la basilega de San Calimer. L\u0027era donca nevod del Carlo Pertusaa e bisnevod del Luca Pertusaa, tucc e duu president del Senad e l\u0027era el quart fioeul di so sgent, dopo el Carlo, el Cristofen e la Lucrezzia. El gh\u0027haveva un teater in la soa cà, el Palazz Pertusaa in Porta Romana che l\u0027era frequentad anca del Ferdinand d\u0027Asborgh, governador de la Lombardìa, e de la mier Maria Beatriz, e anca una stamparia piscinina, che in bas a l\u0027overa la ciamava cont un anagrama del so cognom: gh\u0027è per esempi Setuprati e Trasupeti. (innanz) A l\u0027 savivet qe ... L\u0027incoronazzion de la Vergin del Diego Velázquez La Maria (in ebraich מרים, Miryam, o Myriam, in aramaich Maryām, in grech di Setanta Μαρίαμ, Maríam, o Μαρία, María, in arab: مريم, Maryam; ? - Gerusalem o Efes, 42/45) a l\u0027è la mader del Gesù: despess l\u0027è ciamada \"Madona\" per antonomasia. In bas ai Vangeli, el Pader l\u0027ha scernida per portà in su la terra el sò Fioeul e, a travers del Spirit Sant, ghe l\u0027ha incarnad dent, dopo che el Gabriell gh\u0027ha nonziad che gh\u0027havaria havud un fioeul senza mai vedé un om. La se maridarà comunque poeu con l\u0027Isep, che \u0027l cressarà el Gesù. Quell roeul chi gh\u0027è recognossud anca del Coran, che la ciama Maryam bint \u0027Imran e \u0027l recognoss el nassiment de Vergina, e i musulman la consideren vuna di done pussee importante de la soa fed, insema a l\u0027Asiya, a la Khadīja e a la Fāṭima. In del Coran gh\u0027è anca scrivud che i cristian la veneren \u0027me part de la Trinità, roba che per un quajvun a l\u0027è un esempi de error in del test sacher menter per di alter a l\u0027era una vision eretiga che la se trovava al temp in Arabia. I cristian, in del concili d\u0027Efes, gh\u0027hann dad el titol de Theotókos (in latin Deipara), o ben mader de Dia, inscì de responder al nestorianesim che \u0027l sostegniva che la fuss domà la mader de la natura umana del Gesù e che donca la ciamava domà \"mader de Crist\". Di alter dogma scompartid de la pupart di gese a inn el nassiment de vergin del Gesù e la soa verginità perpetua. La Gesa catolega l\u0027ha recognossud \u0027me dogma, del 1854, l\u0027Imacolada Concezzion, o ben el facc che l\u0027è nassuda senza el pecad original. I ortodoss la ciamen Panaghia, o ben tuta santa. (Va inanz) Ind i oltre lengue... I dex Wikipedie con plussee articoi: Ingles, Cebuan, Todesc, Svedes, Frances, Olandes, Russ, Spagnœl, Italian, Arab Egizian Oltre lengue minoritarie: Piemontes, Catalan, Sardegnœl, Galles, Galizian, Ciovaç, Alemann, Sicilian, Tatar de Crimeia, Mannes. Un proverbe a cas \"In mancanza dei cavai se fa trotar anc\u0027pò a i asen\" Sqiça qé per atualizar la pajina Ocio! La lengua lombarda la g\u0027ha miga un standard parlad o scriit, donca in su la Wikipedia i se dopera plussee de ortografie. L\u0027è conseiad doperar-n vuna in tra la Scriver Lombard e la Nœva Ortografia Lombarda, ma i g\u0027è anc dei grafie locai; per savir-n plussee, varda i ortografie acetade. La Wikipedia la garantess miga i so contegnids e l\u0027è gnanca censurada per i s\u0027cietin. Wikipedia Wikipedia l\u0027è un\u0027enciclopedia libera e portada inants apena de utents volontare. Ol so obietiv l\u0027è de menar la cognossenza libera a tuts e in plussee lengue qe s\u0027pœl. I nosts Cinq Pilaster i è: La Wikipedia l\u0027è un\u0027enciclopedia e miga un regœier de informazion senza controll La Wikipedia la g\u0027ha un pont de vista neutral e i informazion i g\u0027ha de vesser verifegabei La Wikipedia l\u0027è libera: tuts i pœl dar una man a scriver e la g\u0027ha la licenza dobia CC BY-SA e GDFL La Wikipedia la g\u0027ha un codex de comportament e tuts i g\u0027ha de rispetar-s La Wikipedia la g\u0027ha miga dei regolle fisse fœra dei 5 pilaster. Una vox de scriver Analisi numeriga Cossa s\u0027pœl far? G\u0027heet una qualc domanda? Ven in su \u0027l Grott G\u0027heet besogn de una man? Varda ol Benrivad G\u0027heet una pajina web? Met la Wikipedia ind el to sit Lmo-0? Can\u0027t speak Lombard? Come to our Embassy Utegnüü da \"https://lmo.wikipedia.org/w/index.php?title\u003dPagina_principala\u0026oldid\u003d1145309\" Categoria: Pagina principala 118 lengov Afrikaans Alemannisch Aragonés Ænglisc العربية Asturianu Aymar aru Azərbaycanca Башҡортса Boarisch Беларуская Български Bislama Brezhoneg Bosanski Català Tsets",
