    "url": "https://en.wikipedia.org/wiki/Local_government_area",
    "title": "Local government area - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia Administrative division of a country that a local government is responsible for This article needs additional citations for verification. Please help improve this article by adding citations to reliable sources. Unsourced material may be challenged and removed. Find sources: \"Local government area\" – news · newspapers · books · scholar · JSTOR (October 2021) (Learn how and when to remove this message) A local government area (LGA) is an administrative division of a country that a local government is responsible for. The size of an LGA varies by country but it is generally a subdivision of a state, province, division, or territory. The phrase is used as a generalised description in the United Kingdom to refer to a variety of political divisions such as boroughs, counties, unitary authorities, and cities, all of which have a council or similar body exercising a degree of self-government. Each of the United Kingdom\u0027s four constituent countries has its own structure of local government, for example Northern Ireland has local districts; many parts of England have non-metropolitan counties consisting of rural districts; London and many other urban areas have boroughs; there are three islands councils off the coast of Scotland; while the rest of Scotland and all of Wales are divided into unitary authority counties, some of which are officially designated as cities. As such the term local government area is a convenient generic label referring to all of these authorities and the areas within their control. Map of Australian local government areas The term is particularly common in Australia where it is synonymous with \"municipality\".[citation needed] Local government authorities across the country have similar functions and powers,[citation needed] but have different official designations in different states, and according to whether they are urban or rural. Most urban municipalities in all states are \"cities\".[1] Many in Western Australia are officially \"towns\", even within the Perth metropolitan area.[1] Many rural areas in Queensland, New South Wales, Victoria and Western Australia are \"shires\", while rural areas in South Australia have \"district councils\", and those in Tasmania officially use the title \"municipality\".[1] Due to the Australian Capital Territory\u0027s small size it has no local government and is instead overseen by the ACT Legislative Assembly.[1] Australian LGA status by state/territory[1] State/territory LGA status New South Wales Cities Areas Northern Territory Cities Towns Municipalities Shires Queensland Cities Shires Towns Regional councils South Australia Cities Rural cities Municipalities/municipal councils District councils Regional councils Towns Aboriginal councils Tasmania Cities Municipalities Victoria Cities Rural cities Boroughs Shires Western Australia Cities Towns Shires It is largely for this reason that the term \"local government area\", or simply \"LGA\", is favoured over the term \"municipality\", the use of which could easily lead to confusion. In recent years changes to the structures of local government have given rise to new official designations, while other terms have fallen out of favour. In the mid-1990s the state government of Victoria amalgamated almost all municipalities, abolishing many cities and shires, all towns and all but one borough. Queenscliff, south of Melbourne, is now the only place in Australia that is officially a borough. Meanwhile, many \"rural cities\" were formed in largely rural areas where the core town is large enough, in terms of population, to be considered a city. In many such cases that town had previously been governed by a now defunct city council. Restructuring of local government in New South Wales and Queensland in the following decade gave rise to the municipal designations of \"region\" and \"area\", for example, the Sunshine Coast of Queensland was formerly divided into several shires, but is now governed by a single Sunshine Coast Regional Council. \"Local government area\" is also an official designation in The Gambia and Nigeria. Countries [edit] List of countries where \"local government area\" is an official designation: Australia Gambia, The Nigeria See also [edit] List of municipalities in Manitoba § Local government districts Municipal corporation Municipal council Shire Town council References [edit] ^ a b c d e \"Local Government Areas (LGAs) - 1270.0.55.003 - Australian Statistical Geography Standard (ASGS): Volume 3 - Non ABS Structures, June 2020\". Australian Bureau of Statistics. 2020-06-16. Archived from the original on 2021-10-31. Retrieved 2021-10-31. v t e Designations for types of administrative division English terms Common English terms Area Insular area Local government area Special area Unincorporated area Unorganized area Borough County borough Metropolitan borough Canton Half-canton Capital Federal capital Imperial capital City Autonomous city Charter city Independent city I",
