    "title": "Portá antigua - Güiquipeya",
    "content": "Ir al contenido Dendi Güiquipeya Te damus la bienvenía ala Güiquipedia, la ciclopedia que puei edital tola genti. Ara mesmu ain 4077 artícalus ena Güiquipedia n\u0027estremeñu Cencias naturalis Cencias socialis Biografías Tecnología Coltura Sociedá Bienvenía Güiquipedia Ayúa Zona prevas Índizi A–Z El conceju La troji Embassy Help for non-Extremaduran speakers Ayuda para quienes no hablan estremeñu Artícalu señalau María dela O Lejárraga García (San Millán dela Cogolla, La Rioja, 28 de deziembri del 1874 – Güenus Airis, 28 de juñu del 1974) hue una escreviora i femenista española. Tamién hue conocía comu María Martínez Sierra, nombri qu\u0027adotó delos apellíus del su ombri i col que escrevió una grandi parti dela su obra, peru amás muchu delos sus escritus huerun enfirmaus comu María Lejárraga. Tamién hue Deputá al Congressu pol PSOE pola cercuscrición de Graná nel 1933. La su nacencia hue en San Millán dela Cogolla en La Rioja, nuna familia arropá. Alos quatru añinus se muó cona su familia a Carabanchel Baxu, ala calli dela Sombra, pos el su pairi, Leandro Lejárraga Estecha, nacíu en Tormantos, era operaol i exerció la melecina en Mairil. La su mairi, Natividad García Garay, tuvu la su nacencia en Mairil, i s\u0027acupó pessonalmenti dela educación delos sus ijus, seguiendu los pogramas educativus francesis.[2] Estuyó ena Associación pal Enseñaeru dela Mugel, aondi tuvu el primel contatu conas ideas pedagógicas dela Estitución Libri d\u0027Enseñaeru. Acabijó los sus estuyus de Comerciu nel 1891, convirtiendu-si nuna professora d\u0027ingrés pala Escuela d\u0027Estitutrís i Comerciu. Los sus estuyus de magisteriu, los acabijó ena Escuela Normal de Mairil. Quandu era estuyanti, resultó al Congressu Pedagógicu Hispanu-Almericanu, aondi sostribó los postulaus educativus de Emilia Pardo Bazán. Leyel más... Anterioris:Timoteo Pérez Rubio, Villa romana de Torre-Águila, Castellaneu, Anhinojo Folk... Más artícalus señalaus Enteracionis últimas 5 d\u0027outubri Espena el ex presienti d\u0027Estremaúra Guillermo Fernández Vara. 27 d\u0027outubri La presienta dela Junta d\u0027Estremaúra, María Guardiola, disuelvi la Assambrea i convoca elecionis anticipás pal 21 de deziembri. La troji las enteracionis Artícalus últimus Peralea dela Mata, Teatru romanu de Méria, La Cosera, Salvaleón, Podemos, Rafael Nadal, Ciclismu, Irene de Miguel, Campu Arañuelu, Canchu Roanu, Xerti, Regina Turdulorum... Retrataúra señalá Carolina Coronado, escreviora estremeña Ayúa-mus Ayúa ala Güiquipedia traduxiendu velequí estus artícalus: Lista d\u0027artícalus que toa Wikipedia deviera de tenel Lenguas d\u0027Estremaúra El portugués oliventinu es un sudialeutu el portugués alentejanu palrau entovia enos monicípius d\u0027Olivença i Táliga, frutu de bel hormau parti de Portugal duranti muchus sigrus. Categorías Cencias naturalis Astronomía - Biología - Física - Geología - Matemáticas - Química Cencias socialis Antropología - Derechu - Economía - Educación - Filosofía - Geografía - Estoria - Lingüística - Política - Sicología - Sociología Biografías Actoris - Científicus - Deportistas - Escrivientis - Estoriaoris - Informáticus - Músicus - Políticus - Religiosus Cencias apricás i Tenología Agricoltura - Cencias la salú - Comunicacionis – Informática - Ingeniería Artis i Coltura Arquitectura - Artesanía -Religión - Artis gráficas - Cini - Baili - Escoltura - Fotografía - Cuentu - Literatura - Música - Pintura Sociedá Espetáculus - Deportis - Ociu - Juegus Meta-Wiki Cordinación proyetus Commons Conteníu multimedia libri Wiktionary Dicionariu con sinónimus (en ingrés) Wikibooks Librus de testu i manualis (en ingrés) Wikisource Decumentus originalis Wikiquote Coleción de citas (en ingrés) Wikispecies Directoriu especiis (en ingrés) Wikinews Enteracionis libris (en ingrés) Arrecuperau dendi \"https://ext.wikipedia.org/w/index.php?title\u003dPortá_antigua\u0026oldid\u003d124852\" Precural Precural Portá antigua 343 idiomas Añidil tema",
