    "content": "Zum Inhalt springen Aus Wikipedia Boarische WIKIPEDIA Griass di! Servus! Hawedere! in da boarischn Wikipedia mid 27.202 Artike. Des is de Wikipedia in Boarischa Sproch und in de boarischn Dialekt in Bayern, Esterreich, Sidtiroi. Beschreibung • Description • Descripción • Description • Descrizione A beriga Artike Perchtenmaske Chthonische Uaviacha (dt.: chthonische Tiere) san Viacha, de wo in da Mythologie mid da Untawejd, da Finstaniss und da Nocht vabandlt san. Dazua ghean beispuisweis Schlanga, Grodna, Skorpion und Woif. Aus mythologischa Sicht san des Drackn, Weawoif und de Midgardschlang (a Lindwuam), de Kikimora (uaspringle a slawische Geddin) und im Boarischn de Howangoas, de Schiachbeachtn und da Dazzlwuam. Dass de chthonischn Viacha in da Untawejd hausn, hoasst nix andas, ois dass unta da Eadn bzw. in da Eadn wohna und so mid da Eadmuada vabundn san. .. weida lesn (Artike af Standardboarisch) Hosd scho gwisst? ...dass scho in da Stoazeid af oin Kontinentn bei Weiwaleid, Monan und Kindan Zopffrisuan gem hod. ...dass des Woat \"Zopf\" vom Oidboarischn zopf kimt und uaspringle \"Hoarschopf\" bedeidt hod. ...dass da Begriff Zopf mid zupfn, Zopfa und Zipfe eng vawandt is, jo sogor iwas urgermanische mid Toupet. ...dass des Toupet mindastns 5.000 Joar oid is (oidegypischn Grobfund ) und dass da Julius Caesar aa a Toupet drogn hod. ...dass da Irokesenschnitt woarscheinle aa guad 3500 Joar oid is und dass heit aa scho a Irokesnintimrasua gibt. A berigs Buidl Zwetchgnkrampal A Stand mid Zwetschgnmandal bzw. Zwetschgnkrampal aufm Christkindlesmoakt in Niamberg (niamberbarisch: Zwetschgenmännla). Suacha Artikl vo A - Z • Themenportale • Suachhuif Midmocha Griaßde • Midmochtipps • FAQ in deitsch • Wia schreib i a guads Boarisch? • Berige Artikl • Zimftige Artikl • Zuafällige Artikl Iada, 9. Dezémber 2025, 50. KW Spruch: \"Do woggld da Schwanz mim Hund!\" [Wenn etwas verkehrt läuft...] → Boarische Spruchsammlung → Boarische Fluachsammlung Boarisch : Breissisch Leidln, vawendts wieda meara echt Boarische Weata! De hom Schwung, de ham Kroft und an guadn Klang. Desmoi af Standardboarisch: Grantla stod mürrischer Sympathieträger Audio/Video Voimundoartn vo Oidbayern (aus vaschiedne Regiona) Voimundoartn vo Östareich (aus vaschiedne Regiona) Nochrichtn Da MERKUR iwad Boarische Wikipedia Bairisch im Internet: Dialekt bei Wikipedia Boarisch in da Wissnschoft Bayerisches Wörterbuch Wörterbuch der bairischen Mundarten in Österreich De TZ af Boarisch TZ auf Bairisch Artiken iba de Stickln vom Nestroy Stickln vom Johann Nepomuk Nestroy (gschriem vo an bekanntn Weana Autor) Commons Hauptseitn Commons Wikisource Boarischa Text Original Literatua Wikibooks Boarische Biacharei Wikibooks Wikiquote Boarischa Spruch Wikiquote Wiktionary Boarisches Weatabuach Wiktionary Wikinews Boarische Nochrichtn Wikinews Meta-Wiki Koordination Wikispecies Oartnvazeichnis Voh „https://bar.wikipedia.org/w/index.php?title\u003dWikipedia:Hoamseitn\u0026oldid\u003d836222“ 9 Sproochen Alemannisch Deutsch English Nordfriisk Ripoarisch Plattdüütsch Deitsch Pälzisch Seeltersk Suach Suach Wikipedia:Hoamseitn 9 Sproochen An Obschnit dazua doah",
