    "content": "Jump to content From Wikipedia, the free encyclopedia \u003c Template:POTD Picture of the day archives: 2025 December \u003c 2025 December 11 2025 December 13 \u003e Picture of the day The guanaco (Lama guanicoe) is a species of mammal in the family Camelidae, the camelids. Closely related to the llama, the guanaco is native to the steppes, scrublands and mountainous regions of South America, including Peru, Bolivia, Chile, Paraguay and Argentina. It is a diurnal animal, living in small herds consisting of either one male and several females with their young, or separate bachelor herds. It can run at speeds of up to 64 km/h (40 mph), important for avoiding predation. A herbivore, the guanaco grazes on grasses, shrubs, herbs, lichens, fungi, cacti, and flowers, while its natural predators include the puma and the culpeo (Andean fox). Some guanacos are found domesticated in zoos and private herds around the world, and its fiber is also harvested for use in luxury fabrics, being noted for its soft, warm feel. This guanaco was photographed in Torres del Paine, Chile.Photograph credit: Charles J. Sharp Archive – More featured pictures... See also [edit] Template:POTD protected/2025-12-12 Retrieved from \"https://en.wikipedia.org/w/index.php?title\u003dTemplate:POTD/2025-12-12\u0026oldid\u003d1326803459\" Category: Wikipedia Picture of the day December 2025 Search Search Template:POTD/2025-12-12 Add languages Add topic",
