    "title": "James Buchanan - Wikipedia",
    "content": "Jump to content From Wikipedia, the free encyclopedia President of the United States from 1857 to 1861 This article is about the president of the United States. For other people with the same name, see James Buchanan (disambiguation). James Buchanan Daguerreotype c. 1850–1868 15th President of the United States In office March 4, 1857 – March 4, 1861 Vice President John C. Breckinridge Preceded by Franklin Pierce Succeeded by Abraham Lincoln 17th United States Secretary of State In office March 10, 1845 – March 7, 1849 President James K. Polk Zachary Taylor Preceded by John C. Calhoun Succeeded by John M. Clayton United States Senator from Pennsylvania In office December 6, 1834 – March 5, 1845 Preceded by William Wilkins Succeeded by Simon Cameron Member of the U.S. House of Representatives from Pennsylvania In office March 4, 1821 – March 3, 1831 Preceded by Jacob Hibshman Succeeded by William Hiester Constituency 3rd district (1821–1823) 4th district (1823–1831) Committee positions Chair of the House Judiciary Committee In office March 5, 1829 – March 3, 1831 Preceded by Philip P. Barbour Succeeded by Warren R. Davis United States Minister to the United Kingdom In office August 23, 1853 – March 15, 1856 President Franklin Pierce Preceded by Joseph Reed Ingersoll Succeeded by George M. Dallas United States Minister to Russia In office June 11, 1832 – August 5, 1833 President Andrew Jackson Preceded by John Randolph Succeeded by William Wilkins Member of the Pennsylvania House of Representatives from Lancaster County In office December 6, 1814 – December 2, 1816 Preceded by Emanuel Reigart, Joel Lightner, Jacob Grosh, John Graff, Henry Hambright, Robert Maxwell Succeeded by Joel Lightner, Hugh Martin, John Forrey, Henry Hambright, Jasper Slaymaker, Jacob Grosh[1] Personal details Born (1791-04-23)April 23, 1791 Cove Gap, Pennsylvania, U.S. Died June 1, 1868(1868-06-01) (aged 77) Lancaster, Pennsylvania, U.S. Resting place Woodward Hill Cemetery Party Federalist (1814–1824) Democratic-Republican (1824–1828) Democratic (from 1828) Relatives Harriet Lane (niece) James Buchanan Henry (nephew) Education Dickinson College (BA) Occupation Politician lawyer Signature Military service Allegiance United States Branch/service Pennsylvania Militia Years of service 1812–1814[2] Rank Private Unit Shippen\u0027s Cavalry, 1st Brigade, 4th Division Battles/wars War of 1812 Battle of Baltimore Pennsylvania Historical Marker Official name James Buchanan Type Roadside Designated January 1955 James Buchanan Jr. (/bjuːˈkænən/ ⓘ bew-KAN-ən;[3] April 23, 1791 – June 1, 1868) was the 15th president of the United States, serving from 1857 to 1861. He also served as the 17th United States secretary of state from 1845 to 1849 and represented Pennsylvania in both houses of the U.S. Congress. Buchanan was an advocate for states\u0027 rights, particularly regarding slavery, and minimized the role of the federal government preceding the American Civil War. Buchanan was a lawyer in Pennsylvania and won his first election to the state\u0027s House of Representatives as a member of the Federalist Party. He was elected to the U.S. House of Representatives in 1820 and retained that post for five terms, aligning with Andrew Jackson\u0027s Democratic Party. Buchanan served as Jackson\u0027s minister to Russia in 1832. He was elected a U.S. senator from Pennsylvania in 1834 and served for 11 years. He was appointed to serve as President James K. Polk\u0027s secretary of state in 1845, and eight years later was named as President Franklin Pierce\u0027s minister to the United Kingdom. Beginning in 1844, Buchanan became a regular contender for the Democratic Party\u0027s presidential nomination. He was nominated and won the 1856 presidential election. As President, Buchanan intervened to assure the Supreme Court\u0027s majority ruling in the pro-slavery decision in the Dred Scott v. Sandford case. He acceded to Southern attempts to engineer the Kansas Territory\u0027s entry into the Union as a slave state under the Lecompton Constitution, and angered not only Republicans, but also Northern Democrats. Buchanan honored his pledge to serve only one term and supported his Vice President John C. Breckinridge\u0027s unsuccessful candidacy in the 1860 presidential election. He failed to reconcile the fractured Democratic Party amid the grudge against Stephen A. Douglas, leading to the election of Republican and former Congressman Abraham Lincoln. Buchanan\u0027s leadership during his lame duck period, before the American Civil War, has been widely criticized. He simultaneously angered the North by not stopping secession and the South by not yielding to their demands. Buchanan supported the Corwin Amendment in an effort to reconcile the country. He made an unsuccessful attempt to reinforce Fort Sumter, but otherwise refrained from preparing the military. His failure to forestall the American Civil War has been described as incompetence, and he spent his last years defending his reputation. Historians and scholars r",
